-- 导出  表 ddxm.tf_member 结构
CREATE TABLE IF NOT EXISTS `tf_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '上级用户id ',
