REPLACE INTO `tf_article` (`id`, `catid`, `title`, `subtitle`, `content`, `thumb`, `keyword`, `groups`, `hits`, `sort`, `status`, `tel`, `addtime`) VALUES
	(1, 5, '央行调查：超5成居民认为房价“高，难以接受”', '刻录机更深刻的高利贷', '<p><span style="font-size:24px">为了全面贯彻</span>执行国家房地产市场调控政策，完善成都市经营性建设用地供应调控机制，促进土地市场平稳健康发展。近日，成都市人民政府办公厅印发了关于《完善经营性建设用地土地调控机制促进我市土地市场平稳健康发展的通知》。</p><p><br/></p><p>一、编制供应计划，调控经营性建设用地供应总量</p><p><br/></p><p>每年2月15日前，各区(市)县政府(合成都高新区、成都天府新区管委会，下同)根据本辖区可供经营性建设用地、已供经营性建设用地开发利用以及土地市场等情况，编制年度经菅性建设用地供应计划草案报市国土局，由市国土局会同市房管局根据各地前五年经营性建设用地平均供地量、上一年经营性建设用地实际供应量、可售商品住房销售周期、商业办公用房库存量等指标，统筹平衡全市经营性建设用地供应计划，并于当年2月底前报市政府批准后下达执行。</p><p><br/></p><p>二、建立信息系统，动态监测经营性建设用地利用情况</p><p><br/></p><p>由市国土局牵头会同市规划局、市建委、市房管局建立成都市国有建设用地动态监管系统(以下简称：动态监管系统)，集合土地现状、土地规划、城乡规划、用地报征、征后实施以及经营性建设用地的土地供应、规划许可、施工许可、房屋预售、备案登记、地价和房价变化等信息，对国有建设用地开发利用情况进行全过程、多层次动态监测。为科学预判房地产市场形势、调控土地供应总量、把握土地上市节奏、实施精准式供地提供决策依据。</p><p><br/></p><p>三、实施统筹管理，科学精准调控经营性建设用地供应</p><p><br/></p><p>经营性建设用地按照供应计划指导与实时监测控制相结合的方式进行管理。在市政府下达的经营性建设用地供应计划控制指标范国内，各区(市)县政府应统筹安排本辖区的经营性建设用地供应，合理确定县城、重点镇、重点产业发展区的供地规模和用地结构，加大重点支持区域土地供应力度。按照动态监管系统的实时监测结果，对可售商品住房销售周期低于下限的区域，可向市政府申请调增本区域年度经营性建设用地供应计划，适时增加供地规模，适度加快供地节奏，有效管控土地价格，确保适应经济社会发展水平的居住用地需求；对可售商品住房销售周期高于上限或者商业办公用房库存量超过市房管局确定的控制指标的区域，暂停经营性建设用地供应。</p><p><br/></p><p>成都市五城区土地出让方案决策委员会对全市经营性建设用地供应计划实施统筹管理。因重大产业化项目用地、房地产市场变化等因素需调整经营性建设用地供应计划的，各区(市)县政府可向成都市五城区土地出让方案决策委员会提出申请。</p><p><br/></p><p>四、采取有效措施，促进土地供应科学合理</p><p><br/></p><p>1、合理确定土地出让起始(叫)价</p><p><br/></p><p>密切跟踪市场变化情况，认真研究房地产市场价格与税费负担、建安成本、财务费用、合理利润的关系，积极预判市场价格水平，科学确定出让起始(叫)价，避免出现“地王”和“过高溢价率”。</p><p><br/></p><p>2、调整拟上市宗地竞买保证金缴纳比例</p><p><br/></p><p>对热点区域(包括中心城区、龙泉驿区、双流区)内的商品住宅及含商品住宅的经营性用地，相应调整竞买保证金缴纳比例。</p><p><br/></p><p>3、限制单宗商品住宅用地供应规模</p><p><br/></p><p>中心城区不得超过300亩。龙泉驿区、青白江区、新都区、温江区、双流区、郫都区不得超过210亩，简阳市、都江堰市、彭州市、邛崃市、崇州市、金堂县、大邑县、蒲江县、新津县不得超过105亩。</p><p><br/></p><p>4、缩短土地出让价款缴纳期限</p><p><br/></p><p>对上市出让宗地成交溢价率在60%及以上的，要从《国有建设用地使用权出让合同》签订之日起3个月内缴清全部土地出让价款。</p><p><br/></p><p>五、加强协调配合，确保经营性建设用地供应调控效果</p><p><br/></p><p>各区(市)县政府、市政府有关部门、有关单位要密切配合协作，落实工作责任，确保经营性建设用地供应调控取得良好效果。</p><p><br/></p>', 'upload/20170615/1497507849.png', '', '', 0, 0, 1, '', 1483007349),
	(2, 1, '原副省长徐钢受贿案一审：受贿1977万获刑13年', '我就是副标题！！！！！！！', '<p> </p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">2016年12月29日，安徽省合肥市中级人民法院公开宣判福建省人民政府原副省长徐钢受贿案，对被告人徐钢以受贿罪判处有期徒刑十三年，并处罚金人民币二百万元；对徐钢受贿犯罪所得财物及其孳息予以追缴，上缴国库。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">经审理查明：2002年至2014年，被告人徐钢利用担任福建省人民政府副秘书长、福建省交通厅厅长、中共泉州市委书记职务上的便利或者职权和地位形成的便利条件，为相关单位和个人在公司经营、银行揽储、职务晋升等事项上提供帮助，直接或者通过其妻余娜、女儿徐昊皓非法收受相关单位和个人给予的财物共计折合人民币1977万余元。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">合肥市中级人民法院认为，被告人徐钢的行为构成受贿罪。鉴于徐钢到案后，如实供述自己罪行，主动交代办案机关尚未掌握的部分受贿犯罪事实；认罪悔罪，积极退赃，赃款赃物已全部追缴，具有法定、酌定从轻处罚情节，依法可以从轻处罚。法庭遂作出上述判决。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">来源：人民日报</p><p> </p>', 'upload/201612/30/148307670292.jpg', '', '', 0, 0, 0, '', 1483069505),
	(3, 1, '央行调查报告：43.5%居民认为目前房价“可以接受”', '我不能接受！', '<p> <img title="1483070181911100.jpg" alt="141367827.jpg" src="/upload/201612/30/1483070181911100.jpg"/></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">资料图：11月2日，山西太原，置业顾问向民众推荐商品房户型。 中新社记者 韦亮 摄</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">中新网12月29日电 据央行网站消息，中国央行今日发布《2016年第四季度城镇储户问卷调查报告》。报告中的数据显示，52.7%的居民认为目前房价“高，难以接受”，43.5%的居民认为目前房价“可以接受”，3.9%的居民认为“令人满意”。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">2016年第四季度，中国人民银行在全国50个城市进行了2万户城镇储户问卷调查，结果显示：</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">一、物价感受指数</strong></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">当期物价满意指数为 29.2%，较上季提高2.5 个百分点。其中，44.4%的居民认为物价“高，难以接受”，较上季下降 5.6 个百分点。未来物价预期指数为 67.6%，较上季提高 5个百分点。其中，37.3%的居民预期下季物价将“上升”，46.2%的居民预期“基本不变”，5.9%的居民预期“下降”，10.5%的居民“看不准”。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">二、收入感受指数</strong></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">当期收入感受指数为 51.9%，较上季回升 5.7 个百分点。其中，85.9%的居民认为收入“增加”或“基本不变”，较上季提高 6.4个百分点。未来收入信心指数为 54.9%，较上季提高 5.2 个百分点。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">三、就业感受指数</strong></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">当期就业感受指数为 40.1%，较上季提高 3 个百分点。其中，11.9%的居民认为“形势</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">较好，就业容易”，48.7%的居民认为“一般”，39.5%的居民认为“形势严峻，就业难”或“看不准”。未来就业预期指数为 49.4%，较上季回升 3.2 个百分点。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">四、储蓄、投资和消费意愿</strong></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">倾向于“更多储蓄”的居民占 42.4%，较上季回落 1.3 个百分点；倾向于“更多消费”的居民占 23.1%，较上季回升 2 个百分点；倾向于“更多投资”的居民占 34.5%，较上季回落 0.7 个百分点。居民偏爱的前三位投资方式依次为：“银行、证券、保险公司理财产品”、“股票”和“基金信托产品”，选择这三种投资方式的居民占比分别为48.9%、20.7%和19.8%。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">被问及未来 3 个月准备增加支出的项目，按照居民选择比例由高到低排序为：旅游(26.9%)、大额商品(25.5%)、教育(24.5%)、医疗保健(20.9%)、购房(20.1%)、社交文化和娱乐(17.5%)、保险(13.8%)。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">五、房价预期与购房意愿</strong></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">52.7%的居民认为目前房价“高，难以接受”，较上季下降 1 个百分点，43.5%的居民认为目前房价“可以接受”，3.9%的居民认为“令人满意”。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">对下季房价，26.9%的居民预期“上涨”，50.1%的居民预期“基本不变”，10%的居民预期“下降”，13%的居民“看不准”。未来 3 个月内准备出手购买住房的居民占比为<span class="Apple-converted-space"> </span></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">据了解，城镇储户问卷调查是中国人民银行1999年起建立的一项季度调查制度。每季在全国 50个(大、中、小)调查城市、400个银行网点各随机抽取50名储户，全国共20000名储户作为调查对象。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">调查内容包括储户对经济运行的总体判断、储蓄及负债情况、消费情况、 储户基本情况等四个方面。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">(中国新闻网(北京))</p><p> </p>', 'upload/201612/30/148307645250.png', '', '', 0, 0, 0, '', 1483070249),
	(4, 1, '过年回家看看 带父母住进舒适养老房', '多给我一些', '<p> </p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">导读：</strong>一转眼2016年就过去了，春节很快就要来临啦。今年回家过节吗？春运抢到票了吗？还是......自己已经很多年没回家过年啦。在这个独生子女众多的时代，过年不回家，父母就真的要自己过一个冷清的春节啦。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">对于这一代的年轻人来说，能在自己工作的城市为父母买一套养老房，一定是很理想的一件事。这样看望父母变近了，不仅方便照顾、陪伴老人，而且逢年过节一家人团聚也容易了，独生家庭照样可以热热闹闹过春节，尽享天伦之乐啦！</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">小编此次就为大家整理了些福州适合养老的楼盘，和广大的孝子孝女们分享！</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; text-align: center; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"> </p><p><img style="margin: 0px; padding: 0px; border: currentColor; vertical-align: bottom; max-width: 640px;" alt="过年回家看看 带父母住进舒适养老房" src="/upload/201612/30/1483076233371211.png"/></p><p> </p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">推荐楼盘一：凤翔湖滨世纪</strong></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">销售热线：</strong><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">400-819-1111转637317</strong></span></p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">动态：</strong>凤翔湖滨世纪占地面积542209平方米，占地面积542209平方米。目前67-120㎡二至四房发售。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; text-align: center; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"> </p><h3 style="font: 16px/26px 微软雅黑, 黑体; margin: 0px 10px 0px 0px; padding: 0px; float: left; font-size-adjust: none; font-stretch: normal;"><a style="margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none;" >凤翔湖滨世纪</a></h3><p><a style="font: 12px/22px 宋体, 微软雅黑; margin: 2px 40px 0px 0px; padding: 0px; width: 79px; height: 22px; text-align: center; color: rgb(255, 255, 255); text-decoration: none; float: left; display: block; font-size-adjust: none; font-stretch: normal; background-image: url("http://mat1.gtimg.com/house/cmsearth/view_btn.png"); background-repeat: no-repeat no-repeat;" class="view_btn" >查看详情</a><span style="font: 12px/30px 宋体, 微软雅黑; margin: 0px; padding: 0px; float: left; font-size-adjust: none; font-stretch: normal;" class="house_price">均价<em style="margin: 0px; padding: 0px; color: rgb(165, 0, 0); font-size: 16px; font-style: normal; font-weight: bold;" class="num">12500<span class="Apple-converted-space"> </span></em>元/平方米</span></p><p><a style="font: 12px/26px 宋体, 微软雅黑; margin: 0px; padding: 0px 6px; color: rgb(51, 114, 188); text-decoration: none; display: inline-block; font-size-adjust: none; font-stretch: normal;" >小户型</a><a style="font: 12px/26px 宋体, 微软雅黑; margin: 0px; padding: 0px 6px; color: rgb(51, 114, 188); text-decoration: none; display: inline-block; font-size-adjust: none; font-stretch: normal;" >loft</a></p><p><a style="margin: 0px; padding: 0px 12px 0px 0px; color: rgb(51, 114, 188); text-decoration: none;" class="first" >楼盘图库</a>|<a style="margin: 0px; padding: 0px 12px; color: rgb(51, 114, 188); text-decoration: none;" >最新动态</a></p><p><em style="margin: 0px; padding: 0px; font-style: normal;" class="phone_ico"></em>400-819-1111转637317</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; text-align: center; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"> </p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">楼盘地址：</strong>福州市闽侯县荆溪东大道66号</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">项目介绍：</strong>凤翔湖滨世纪建筑面积约88-111㎡醇美三居心动上市，项目坐落于闽侯荆溪，规划中的地铁5号线首站、凤翔·首邑温泉度假村以及项目自身配备商业，将打造闽侯荆溪生活核心区。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">配套：</strong>附近有闽侯县百益幼儿园和荆溪永鑫便利店、桐口桥头林孟英食杂店等商店。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">交通：</strong>西江滨大道、甘洪路、绕城高速、三环路可直达；地铁5号线可达门口，并与4号线交汇；公交有33、38路城乡巴士等多条公交线路。如果开车则是过西客站往北走甘洪路到绿洲家园，沿着凤翔的灯杆旗继续行驶即可到达。</p><p style="font: 16px/28px 宋体, Arial, sans-serif; margin: 0px 0px 29px; padding: 0px; color: rgb(0, 0, 0); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><strong style="margin: 0px; padding: 0px;">推荐理由：</strong>项目位于闽侯，离市中心较远，可过慢节奏生活。居住环境安静，依山伴水；独占荆溪绿肺之地，北依大嘉山，南临闽江生态宜人，方便老人散步休闲，适宜养老。周围有超市、市场，生活方便。</p><p></p>', '', '', '', 0, 0, 0, '', 1483076250),
	(5, 5, 'jk值说明', '资产管理资产管理资产管理资产管理资产管理资产管理资资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理资产管理', '<p><span style="font-size: 18px;"></span></p><p>    <strong><span style="font-family: 宋体;">什么是</span>JK</strong><strong><span style="font-family: 宋体;">值？</span></strong></p><p>    JK<span style="font-family: 宋体;">值是针对铸币师分红的计算指标（即只有铸币师才拥有</span>JK<span style="font-family: 宋体;">值）。</span>JK<span style="font-family: 宋体;">值越高，能得到的分红也越多。</span></p><p> </p><p><span style="font-family: 宋体;"><img title="1484810744645614.png" alt="JK值获得的途径.png" src="/upload/201701/19/1484810744645614.png"/></span></p><p> </p><p>    <strong>JK</strong><strong><span style="font-family: 宋体;">值有什么用处？</span></strong></p><p>    <span style="font-family: 宋体;">根据铸币师的不同等级，</span>JK<span style="font-family: 宋体;">值可转换为不同比率的克鲁格金币，并参与教练级分红。</span></p><p><span style="font-family: 宋体;"><br/></span></p><p><span style="font-family: 宋体;"><br/></span></p><p><br/></p><p><br/></p>', 'upload/20170615/1497517142.png', '', '', 0, 0, 1, '', 1483597096),
	(6, 6, '米币说明', '米币说明', '<p><span style="font-size: 18px;"><strong><span style="font-family: 宋体;">        米币是什么？</span></strong></span></p><p><span style="font-size: 18px;"><strong><span style="font-family: 宋体;">        </span></strong></span><span style="font-family: 宋体; font-size: 18px;">米币是“老鼠爱大米”中的一种消费积分，参与游戏、购买商品等都可以使用米币。</span></p><p><span style="font-family: 宋体; font-size: 18px;">        </span><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;">注：平台赠送米币的转换率跟美元和人民币的每日汇率有关。</span></span></p><p><span style="font-family: 宋体; font-size: 18px;"> </span></p><p><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;"><img title="1484810595344191.png" alt="米币的获取方式.png" src="/upload/201701/19/1484810595344191.png"/></span></span></p><p><span style="font-size: 18px;"> </span></p><p style="text-indent: 28px;"><span style="font-size: 18px;"><strong><span style="font-family: 宋体; font-size: 18px;">米币的作用：</span></strong></span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">作为平台赠送的消费积分，用于平台投资、游戏或商品换购等。</span></p><p><span style="font-family: 宋体; font-size: 18px;"><br/></span><br/></p><p> </p>', '', '', '', 0, 0, 1, '', 1483597122),
	(7, 10, '金鸡账户说明', '金鸡账户说明', '<p>    <span style="font-family:宋体">金鸡账户是用于记录专用金币收入与支出的专属账户。</span></p><p> </p><p>    <span style="font-family:宋体">金鸡账户中的货币统称为专用金币，来自于是每次生成金币的</span>10%<span style="font-family:宋体">。</span></p><p> </p><p>    <span style="font-family:宋体">金鸡币可在“金鸡下蛋”模块中使用。</span></p><p><br/></p>', '', '', '', 0, 0, 1, '', 1483599816),
	(8, 9, '分红权重说明', '分红权重说明', '<p style="text-indent: 28px;"><strong><span style="font-family: 宋体; font-size: 16px;"></span></strong><span style="font-family: 宋体; font-size: 18px;">分红权重仅限教练级别铸币师所有，非教练级别的铸币师无法享受分红权重带来的收益。</span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">它是用于计算教练级铸币师分红奖励的一个评判标准。当团队伙伴在满足等级权重条件的情况下，也可计算为你的权重。权重越高，表示成绩越好，将获得的分红奖励就越多。</span></p><p><span style="font-size: 18px;"> </span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">根据分红权重，各教练级别铸币师可获得的月结分红如下：</span></p><p><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;">（注：月结分红为</span>JK<span style="font-family: 宋体; font-size: 18px;">值，不转化为克鲁格金币，直接实现裂变，其中</span>80%<span style="font-family: 宋体; font-size: 18px;">裂变为金币、</span>20%<span style="font-family: 宋体; font-size: 18px;">裂变为米币</span> <span style="font-family: 宋体; font-size: 18px;">。</span></span></p><p><span style="font-family: 宋体; font-size: 18px;">）</span></p><p style="text-align: center;"><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;"><img title="1484810492726293.png" alt="月结分红.png" src="/upload/201701/19/1484810492726293.png"/><br/></span></span></p><p><br/></p><p><br/><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;"></span></span></p><p><br/></p>', '', '', '', 0, 0, 1, '', 1483599827),
	(9, 8, '克鲁格金币', '克鲁格金币', '<p><span style="font-family: 宋体; font-size: 18px;"></span></p><p>    <strong><span style="font-family: 宋体;">什么是克鲁格金币？</span></strong></p><p>    <span style="font-family: 宋体;">在“老鼠爱大米”中，它作为一种特殊的金币，可被拆分成金币和米币，是财富的象征。</span></p><p> </p><p style="text-indent: 28px;"><strong><span style="font-family: 宋体;">克鲁格金币的获得途径：</span></strong></p><p style="text-indent: 28px;"><span style="font-family: 宋体;">由</span>JK<span style="font-family: 宋体;">值根据铸币师等级兑换生成。</span></p><p> </p><p style="text-indent: 28px;"><strong><span style="font-family: 宋体;">克鲁格金币的拥有资格：</span></strong></p><p style="text-indent: 28px;"><span style="font-family: 宋体;">升级为铸币师将拥用该金币。（非铸币师的用户所得</span>JK<span style="font-family: 宋体;">值转换的克鲁格金币将归距离最近的铸币师所有）</span></p><p> </p><p style="text-indent: 28px;"><strong><span style="font-family: 宋体;">克鲁格金币拆分方式：</span></strong></p><p style="text-indent: 28px;"><span style="font-family: 宋体;">根据次日上证指数开盘价的最后一位数字进行拆分，完成金币和米币的转换。</span></p><p style="text-indent: 28px;"><span style="font-family: 宋体;"><img title="1484810462532566.png" alt="克鲁格金币拆分方式.png" src="/upload/201701/19/1484810462532566.png"/></span></p><p><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;"></span></span><br/></p><p><br/></p>', '', '', '', 0, 0, 1, '', 1483599846),
	(10, 7, '金币说明', '金币说明', '<p><span style="font-family: 宋体; font-size: 18px;"></span></p><p><span style="font-size: 18px;">     <strong><span style="font-family: 宋体;">什么是金币？</span></strong></span></p><p><span style="font-size: 18px;">     <span style="font-family: 宋体; font-size: 18px;">金币是“老鼠爱大米”中的数字资产，可用于消费、投资、提现等。</span></span></p><p><span style="font-size: 18px;"> </span></p><p style="text-align: center; white-space: normal;"><span style="font-size: 18px;"><span style="font-family: 宋体;"><span style="font-size: 18px;"><img title="1484810352948484.png" alt="第一张-金币的获取方式.png" src="/upload/201701/19/1484810352948484.png"/></span></span></span></p><p><span style="font-size: 18px;"> </span></p><p><span style="font-size: 18px;"><strong><span style="font-family: 宋体; font-size: 18px;"></span></strong></span></p><p style="text-align: center;"><span style="font-size: 18px;"> <img title="1484810364611259.png" alt="第二张-金币的作用.png" src="/upload/201701/19/1484810364611259.png"/></span></p><p style="line-height: 15px;"><span style="font-family: 宋体; font-size: 18px;"><br/></span></p><p style="line-height: 15px;"><span style="font-family: 宋体; font-size: 18px;"><br/></span></p><p style="line-height: 15px;"><span style="font-family: 宋体; font-size: 18px;"><br/></span></p>', '', '', '', 0, 0, 1, '', 1483599926),
	(11, 11, '苹果乐园说明', '苹果乐园说明', '<p><span style="font-size: 18px;"> <strong><span style="font-family: 宋体;">什么是苹果乐园？</span></strong></span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">苹果乐园是玩家收获苹果金的地方。</span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">苹果金将由苹果积分与积分分红率计算生成。</span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">苹果金可用于购买商品时抵扣商品价格、认购可转债及提现等。</span></p><p><span style="font-size: 18px;">         <span style="font-family: 宋体; font-size: 18px;">【</span>*<span style="font-family: 宋体; font-size: 18px;">需要程序一个链接，可以跳转到苹果资产里，查看资产说明】</span></span></p><p><span style="font-size: 18px;"> </span></p><p><span style="font-size: 18px;">    <strong><span style="font-family: 宋体; font-size: 18px;">在苹果乐园如何获得收益？</span></strong></span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">用户可以通过创建苹果乐园、雇佣园丁，以及对果树进行养护，获得苹果积分，再通过苹果积分计算苹果金。</span></p><p style="text-indent: 28px;"><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;">首次创建苹果乐园的用户，平台还会额外赠送</span>10000<span style="font-family: 宋体; font-size: 18px;">苹果积分，该积分根据分红率将生成</span>100<span style="font-family: 宋体; font-size: 18px;">枚苹果金。</span></span></p><p><span style="font-size: 18px;"> </span></p><p><span style="font-size: 18px;">    <strong><span style="font-family: 宋体; font-size: 18px;">收益如何计算？</span></strong></span></p><p style="text-indent: 28px; margin-left: 0px;"><span style="font-size: 18px;">1、<span style="font-family: 宋体; font-size: 18px;">苹果积分：</span></span></p><p style="margin-left: 28px;"><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;">首次创建苹果乐园时，将以</span>10000<span style="font-family: 宋体; font-size: 18px;">苹果积分的</span>1/10<span style="font-family: 宋体; font-size: 18px;">作为裂变基数进行裂变。</span></span></p><p style="margin-left: 28px;"><span style="font-family: 宋体; font-size: 18px;">其他时间，将以拥有的苹果积分为裂变基数，进行裂变，赠送给他的上级、上级的上级……以此类推。</span></p><p style="margin-left: 28px;"><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;">积分裂变率为</span>0.25<span style="font-family: 宋体; font-size: 18px;">。</span></span></p><p style="margin-left: 28px;"><span style="font-family: 宋体; font-size: 18px;">另外，通过在每个季度内达到的不同养护等级（即在“苹果乐园”中消费的米币），提升积分分红率。</span></p><p style="text-align: center;"><span style="font-size: 18px;"> <img title="1484810293776899.png" alt="第一张-苹果积分.png" src="/upload/201701/19/1484810293776899.png"/></span></p><p><span style="font-size: 18px;"> </span></p><p style="text-indent: 28px;"><span style="font-size: 18px;">2<span style="font-family: 宋体; font-size: 18px;">、苹果金：根据所获得的苹果积分，按照分红率进行计算，即时获得。</span></span></p><p><span style="font-size: 18px;">    <span style="font-family: 宋体; font-size: 18px;">根据积分分红率，计算出本次分红收益：本次分红收益＝“苹果积分”×分红率－本季度已获得的分红收益。</span></span></p><p><span style="font-size: 18px;">    <span style="font-family: 宋体; font-size: 18px;">每次分红收益，大于等于</span>0.01<span style="font-family: 宋体; font-size: 18px;">部分进入苹果金，小于</span>0.01<span style="font-family: 宋体; font-size: 18px;">部分累计至下次分红收益。</span></span></p><p style="text-align: center;"><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;"><img title="1484810316945264.png" alt="第二张-苹果金计算.png" src="/upload/201701/19/1484810316945264.png"/></span></span></p><p><span style="font-size: 18px;">    <span style="font-family: 宋体; font-size: 18px;">举例：“苹果积分”为</span>10200.5<span style="font-family: 宋体; font-size: 18px;">积分，分红率为</span>1%<span style="font-family: 宋体; font-size: 18px;">，本季度已获得</span>100<span style="font-family: 宋体; font-size: 18px;">苹果金分红收益，则本次分红收益＝</span>10200.5<span style="font-family: 宋体; font-size: 18px;">×</span>1%<span style="font-family: 宋体; font-size: 18px;">－</span>100<span style="font-family: 宋体; font-size: 18px;">＝</span>102.005<span style="font-family: 宋体; font-size: 18px;">金币，则本次分红收益有</span>102<span style="font-family: 宋体; font-size: 18px;">金币进入苹果金，剩余</span>0.005<span style="font-family: 宋体; font-size: 18px;">金币累计至下次分红收益。</span></span></p><p><span style="font-size: 18px;"> </span></p><p><br/></p>', 'upload/201701/06/148367311290.jpg', '', '', 0, 0, 1, '', 1483673116),
	(12, 12, '铸币师说明', '', '<p style="line-height:24px"> <span style="font-family:宋体">铸币师是“老鼠爱大米”平台中的玩家身份之一，分为铸币师助理、中级铸币师、高级铸币师、教练级铸币师、</span>1<span style="font-family:宋体">级教练铸币师、</span>2<span style="font-family:宋体">级教练铸币师、</span>3<span style="font-family:宋体">级教练铸币师共</span>7<span style="font-family:宋体">个等级。</span></p><p style="line-height:24px"> </p><p style="margin-left:0;text-indent:0;line-height:24px"><strong>1、</strong><strong><span style="font-family:宋体">铸币师助理</span></strong></p><p style="line-height:24px"><a name="OLE_LINK1"></a><strong><span style="font-size:20px;font-family:宋体">·</span></strong><span style="font-family:宋体">推荐</span>VIP<span style="font-family:宋体">会员人数达</span>5<span style="font-family:宋体">个以上即可升级为</span><span style="font-family:宋体">铸币师助理。</span></p><p style="line-height:24px"><a name="OLE_LINK2"></a><strong><span style="font-size:20px;font-family:宋体"> </span></strong></p><p style="line-height:24px"><strong><span style="font-size:20px;font-family: 宋体">·</span></strong><span style="font-family:宋体">铸币师助理拥有克鲁格金币、</span>JK<span style="font-family:宋体">值</span><span style="font-family:宋体">，享有秒结分红。</span></p><p style="line-height:24px"> </p><p style="line-height:24px"><strong><span style="font-size:20px;font-family:宋体">·</span></strong><a name="OLE_LINK5"></a><span style="font-family:宋体">秒结分红（立即获得分红</span>JK<span style="font-family:宋体">值）</span></p><p style="line-height:24px">   <span style="font-family:宋体">①辅导奖：当下级购买商品，享受该商品</span>JK<span style="font-family:宋体">值的</span>10%<span style="font-family:宋体">分红。</span></p><p style="line-height:24px">   <span style="font-family:宋体">②等级奖：享受铸币师助理对应的分红：</span>JK<span style="font-family:宋体">值的</span>10%<span style="font-family:宋体">分红。</span></p><p style="line-height:24px"> </p><p style="margin-left:0;text-indent:0;line-height:24px"><strong>2、</strong><strong><span style="font-family:宋体">中级铸币师</span></strong></p><p style="line-height:24px"><a name="OLE_LINK3"></a><strong><span style="font-size:20px;font-family:宋体">·