	(15, 1, '去年四季度GDP同比增长6.8% 全年增长6.7%突破70万亿', '初步核算，全年国内生产总值744127亿元，按可比价格计算，比上年增长6.7%。分季度看，一季度同比增长6.7%，二季度增长6.7%，三季度增长6.7%，四季度增长6.8%。分产业看，第一产业增加值63671亿元，比上年增长3.3%；第二产业增加值296236亿元，增长6.1%；第三产业增加值384221亿元，增长7.8%。', '<p><span style="font-size: 18px;"><img src="/upload/201701/20/1484905892289581.jpg" title="1484905892289581.jpg" alt="1.jpg"/></span></p><p><span style="font-size: 18px;">中国2016年四季度GDP同比增长6.8%，预期6.7%，前值6.7%。2016年全年GDP同比增长6.7%，预期6.7%，前值6.7%。四季度GDP环比增长1.7%，预期1.7%，前值1.8%。<br/><br/>　　中国2016年12月规模以上工业增加值同比增长6%，预期6.1%，前值6.2%。全年规模以上工业增加值同比增长6%，预期6%，前值6%。<br/><br/>　　中国2016年12月社会消费品零售总额同比增长10.9%，预期10.7%，前值10.8%。全年社会消费品零售总额同比增长10.4%，预期10.4%，前值10.4%。<br/><br/>　　中国2016年城镇固定资产投资同比增长8.1%，预期8.3%，前值8.3%。<br/><br/>　　中国2016年民间固定资产投资365219亿元，比上年名义增长3.2%。<br/><br/>　　中国2016年全国房地产开发投资102581亿元，比上年名义增长6.9%。<br/><br/><span style="color: rgb(255, 0, 0);">　<strong>　2016年国民经济实现“十三五”良好开局</strong></span><br/><br/>　　2016年，面对错综复杂的国内外经济环境，在以习近平同志为核心的党中央坚强领导下，全国上下统筹推进“五位一体”总体布局和协调推进“四个全面”战略布局，坚持稳中求进工作总基调，坚持新发展理念，以推进供给侧结构性改革为主线，适度扩大总需求，坚定推进改革，妥善应对风险挑战，引导形成良好社会预期，国民经济运行缓中趋稳、稳中向好，实现了“十三五”良好开局。<br/><br/>　　初步核算，全年国内生产总值744127亿元，按可比价格计算，比上年增长6.7%。分季度看，一季度同比增长6.7%，二季度增长6.7%，三季度增长6.7%，四季度增长6.8%。分产业看，第一产业增加值63671亿元，比上年增长3.3%；第二产业增加值296236亿元，增长6.1%；第三产业增加值384221亿元，增长7.8%。<br/><br/><strong>　　一、粮食生产再获丰收，畜牧业生产形势基本稳定</strong><br/><br/>　　全年全国粮食总产量61624万吨，比上年减少520万吨，下降0.8%，仍是历史第二高产年。其中，夏粮产量13920万吨，下降1.2%；早稻产量3278万吨，下降2.7%；秋粮产量44426万吨，下降0.6%。棉花产量534万吨，下降4.6%。油料产量3613万吨，增长2.2%。蔬菜产量80005万吨，增长1.9%。水果产量28319万吨，增长3.4%。全年猪牛羊禽肉产量8364万吨，比上年下降1.1%。其中，猪肉产量5299万吨，下降3.4%；牛肉产量717万吨，增长2.4%；羊肉产量459万吨，增长4.2%；禽肉产量1888万吨，增长3.4%。禽蛋产量3095万吨，增长3.2%。牛奶产量3602万吨，下降4.1%.<br/><br/><strong>　　二、工业生产平稳增长，企业效益明显好转</strong><br/><br/>　　全年全国规模以上工业增加值比上年实际增长6.0%，增速与前三季度持平。分经济类型看，国有控股企业增加值增长2.0%，集体企业下降1.3%，股份制企业增长6.9%，外商及港澳台商投资企业增长4.5%。分三大门类看，采矿业增加值下降1.0%，制造业增长6.8%，电力、热力、燃气及水生产和供应业增长5.5%。高技术产业增加值比上年增长10.8%，比规模以上工业快4.8个百分点，占规模以上工业比重为12.4%，比上年提高0.6个百分点。全年规模以上工业企业产销率达到97.8%。规模以上工业企业实现出口交货值119191亿元，比上年增长0.4%.12月份，规模以上工业增加值同比增长6.0%，环比增长0.46%.<br/><br/>　　1-11月份，全国规模以上工业企业实现利润总额60334亿元，同比增长9.4%，比前三季度加快1.0个百分点。规模以上工业企业主营业务收入利润率为5.85%，同比上升0.26个百分点。<br/><br/><strong>　　三、固定资产投资缓中趋稳，商品房待售面积减少</strong><br/><br/>　　全年固定资产投资(不含农户)596501亿元，比上年名义增长8.1%(扣除价格因素实际增长8.8%)，增速比前三季度回落0.1个百分点。其中，国有控股投资213096亿元，增长18.7%；民间投资365219亿元，增长3.2%，比前三季度加快0.7个百分点，占全部投资的比重为61.2%。分产业看，第一产业投资18838亿元，增长21.1%；第二产业投资231826亿元，增长3.5%；第三产业投资345837亿元，增长10.9%，其中基础设施投资118878亿元，增长17.4%。高技术产业投资增长15.8%，增速快于全部投资7.7个百分点。全年固定资产投资到位资金606969亿元，比上年增长5.8%。新开工项目计划总投资493295亿元，增长20.9%。从环比看，12月份固定资产投资(不含农户)增长0.53%.<br/><br/>　　全年全国房地产开发投资102581亿元，比上年名义增长6.9%(扣除价格因素实际增长7.5%)，增速比前三季度加快1.1个百分点，比上年加快5.9个百分点，其中住宅投资增长6.4%。房屋新开工面积166928万平方米，比上年增长8.1%，其中住宅新开工面积增长8.7%。全国商品房销售面积157349万平方米，增长22.5%，其中住宅销售面积增长22.4%。全国商品房销售额117627亿元，增长34.8%，其中住宅销售额增长36.1%。房地产开发企业土地购置面积22025万平方米，比上年下降3.4%.12月末，全国商品房待售面积69539万平方米，比上年末下降3.2%。房地产开发企业到位资金144214亿元，比上年增长15.2%.<br/><br/>　<strong>　四、市场销售平稳较快增长，消费升级类商品增长较快</strong><br/><br/>　　全年社会消费品零售总额332316亿元，比上年名义增长10.4%(扣除价格因素实际增长9.6%)，增速与前三季度持平。其中，限额以上单位消费品零售额154286亿元，增长8.1%。按经营单位所在地分，城镇消费品零售额285814亿元，增长10.4%；乡村消费品零售额46503亿元，增长10.9%。按消费类型分，餐饮收入35799亿元，增长10.8%；商品零售296518亿元，增长10.4%，其中限额以上单位商品零售145073亿元，增长8.3%。通讯和居住类商品增长较快，通讯器材增长11.9%，家具增长12.7%，建筑及装潢材料增长14.0%.12月份，社会消费品零售总额同比名义增长10.9%(扣除价格因素实际增长9.2%)，环比增长0.89%.<br/><br/>　　全年全国网上零售额51556亿元，比上年增长26.2%。其中，实物商品网上零售额41944亿元，增长25.6%，占社会消费品零售总额的比重为12.6%，比上年提高1.8个百分点。<br/><br/>　　<strong>五、出口降幅收窄，进口由负转正</strong><br/><br/>　　全年进出口总额243344亿元，比上年下降0.9%，降幅比上年收窄6.1个百分点。其中，出口138409亿元，下降2.0%；进口104936亿元，增长0.6%。一般贸易进出口占进出口总值的比重为55%，比上年提高1个百分点。进出口相抵，顺差33473亿元。分季度看，一、二、三季度出口分别同比下降7.9%、0.8%和0.3%，四季度增长0.3%.12月份，进出口总额25871亿元，同比增长4.9%。其中，出口14313亿元，增长0.6%；进口11559亿元，增长10.8%.<br/><br/><strong>　　六、居民消费价格温和上涨，工业生产者价格月度同比由降转升</strong><br/><br/>　　全年居民消费价格比上年上涨2.0%，涨幅与前三季度持平。其中，城市上涨2.1%，农村上涨1.9%。分类别看，食品烟酒价格上涨3.8%，衣着上涨1.4%，居住上涨1.6%，生活用品及服务上涨0.5%，交通和通信下降1.3%，教育文化和娱乐上涨1.6%，医疗保健上涨3.8%，其他用品和服务上涨2.8%。在食品烟酒价格中，粮食价格上涨0.5%，猪肉价格上涨16.9%，鲜菜价格上涨11.7%.12月份，居民消费价格同比上涨2.1%，环比上涨0.2%。全年工业生产者出厂价格比上年下降1.4%，自9月份起结束连续54个月同比下降后，同比涨幅不断扩大，12月份同比上涨5.5%，环比上涨1.6%。全年工业生产者购进价格比上年下降2.0%，12月份同比上涨6.3%，环比上涨1.9%.<br/><br/>　<strong>　七、居民收入稳定增长，城乡差距继续缩小</strong><br/><br/>　　全年全国居民人均可支配收入23821元，比上年名义增长8.4%，扣除价格因素实际增长6.3%。按常住地分，城镇居民人均可支配收入33616元，增长7.8%，扣除价格因素实际增长5.6%；农村居民人均可支配收入12363元，增长8.2%，扣除价格因素实际增长6.2%。城乡居民人均收入倍差2.72，比上年缩小0.01。全国居民人均可支配收入中位数20883元，比上年名义增长8.3%。按全国居民五等份收入分组，低收入组人均可支配收入5529元，中等偏下收入组人均可支配收入12899元，中等收入组人均可支配收入20924元，中等偏上收入组人均可支配收入31990元，高收入组人均可支配收入59259元。全年全国居民人均消费支出17111元，比上年名义增长8.9%，扣除价格因素实际增长6.8%。全年农民工总量28171万人，比上年增加424万人，增长1.5%。其中，本地农民工11237万人，增长3.4%；外出农民工16934万人，增长0.3%。农民工月均收入水平3275元，比上年增长6.6%.<br/><br/><strong>　　八、供给侧结构性改革取得积极进展，经济结构继续优化</strong><br/><br/>　　“三去一降一补”成效初显。钢铁煤炭行业圆满完成全年去产能任务，全年原煤产量比上年下降9.4%.11月末，规模以上工业企业产成品存货同比增长0.5%，增速同比放缓4.1个百分点。商品房库存水平持续下降，12月末商品房待售面积比上年末减少2314万平方米。工业企业资产负债率及成本均有所下降。11月末，规模以上工业企业资产负债率为56.1%，同比下降0.6个百分点；1-11月份，规模以上工业企业每百元主营业务收入中的成本为85.76元，同比减少0.14元。短板领域投资加快，全年生态保护和环境治理业、水利管理业、农林牧渔业投资分别比上年增长39.9%、20.4%和19.5%，分别快于全部投资31.8、12.3和11.4个百分点。<br/><br/>　　经济持续转型升级。产业结构优化转型，全年第三产业增加值占国内生产总值的比重为51.6%，比上年提高1.4个百分点，高于第二产业11.8个百分点。需求结构继续改善，全年最终消费支出对国内生产总值增长的贡献率为64.6%。创新驱动发展战略深入实施，航天空间站、飞船火箭、量子通信、高速计算、对天观测、大飞机等领域一批科技成果不断涌现。新动能快速成长，战略性新兴产业增加值比上年增长10.5%，增速比规模以上工业高4.5个百分点。大众创业万众创新扎实推进，全国新登记企业553万户，比上年增长24.5%，平均每天新登记企业1.5万户。工业小微企业景气回升，1至4季度景气指数分别为87.2，90.6，92.0，93.3。节能降耗成效突出，全年单位国内生产总值能耗比上年下降5.0%，水电、风电、核电、天然气等清洁能源消费比重比上年提高1.6个百分点。<br/><br/><strong>　　九、货币信贷平稳增长，新增贷款同比多增</strong><br/><br/>　　12月末，广义货币(M2)余额155.01万亿元，比上年末增长11.3%，狭义货币(M1)余额48.66万亿元，增长21.4%，流通中货币(M0)余额6.83万亿元，增长8.1%.12月末，人民币贷款余额106.6万亿元，人民币存款余额150.59万亿元。全年新增人民币贷款12.65万亿元，比上年多增9257亿元，新增人民币存款14.88万亿元，比上年少增924亿元。全年社会融资规模增量为17.8万亿元。<br/><br/><strong>　　十、人口总量平稳增长，城镇化率继续提高</strong><br/><br/>　　年末中国大陆总人口(包括31个省、自治区、直辖市和中国人民解放军现役军人，不包括香港、澳门特别行政区和台湾省以及海外华侨人数)138271万人，比上年末增加809万人。全年出生人口1786万人，比上年多增131万人，人口出生率为12.95‰；死亡人口977万人，人口死亡率为7.09‰；人口自然增长率为5.86‰，比上年提高0.9个千分点。从性别结构看，男性人口70815万人，女性人口67456万人，总人口性别比为104.98(以女性为100)。从年龄构成看，16周岁以上至60周岁以下(不含60周岁)的劳动年龄人口90747万人，占总人口的比重为65.6%；60周岁及以上人口23086万人，占总人口的16.7%；65周岁及以上人口15003万人，占总人口的10.8%。从城乡结构看，城镇常住人口79298万人，比上年末增加2182万人，乡村常住人口58973万人，减少1373万人，城镇人口占总人口比重(城镇化率)为57.35%。全国人户分离人口(即居住地和户口登记地不在同一个乡镇街道且离开户口登记地半年以上的人口)2.92亿人，比上年末减少203万人，其中流动人口2.45亿人，比上年末减少171万人。年末全国就业人员77603万人，其中城镇就业人员41428万人。<br/><br/>　　总的来看，2016年国民经济运行保持在合理区间，发展的质量和效益提高。同时应当看到，国际国内经济环境依然错综复杂，经济稳中向好的基础尚不牢固。下一步，我们要更加紧密地团结在以习近平同志为核心的党中央周围，认真贯彻落实党中央、国务院决策部署和中央经济工作会议精神，坚持稳中求进工作总基调，坚持以提高发展质量和效益为中心，坚持宏观政策要稳、产业政策要准、微观政策要活、改革政策要实、社会政策要托底的政策思路，坚持以推进供给侧结构性改革为主线，适度扩大总需求，加强预期引导，深化创新驱动，全面做好稳增长、促改革、调结构、惠民生、防风险各项工作，促进经济平稳健康发展和社会和谐稳定，以优异成绩迎接党的十九大胜利召开。<br/><br/></span></p>', '', '', '', 0, 0, 0, '', 1484905606),
	(13, 13, '可转债说明', '可转债说明', '<p><span style="font-size: 18px;">    <span style="font-family: 宋体;">可转债是一种投资债券，限会员及以上级别的用户购买。</span></span></p><p><span style="font-size: 18px;"><span style="font-family: 宋体;"><br/></span></span></p><p style="text-indent: 28px;"><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;">在“老鼠爱大米”中，可转债需使用苹果金购买，获得的利息为金币，用户每天都可以收获利息。当可转债到期后</span><span style="font-family: 宋体; font-size: 18px;">，用户可选择返本付息或转股付息。</span></span></p><p><span style="font-size: 18px;">   <strong><span style="font-size: 20px;"> </span></strong><strong><span style="font-family: 宋体; font-size: 20px;">·</span></strong><span style="font-family: 宋体; font-size: 18px;">返本付息：用户一次获得所有利息及本金。</span></span></p><p><span style="font-size: 18px;">    <strong><span style="font-family: 宋体; font-size: 20px;">·</span></strong><span style="font-family: 宋体; font-size: 18px;">转股付息：用户一次获得所有利息，并将可转债转换成<span style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 18px;">《福建众合智慧信息科技有限公司》</span>股份。</span></span></p><p><span style="font-family: 宋体;"><br/></span></p><p> <span style="font-family: 宋体;">注：当可转债交易市场上线后，用户还可将可转债挂在交易市场上进行交易。</span></p><p><span style="font-family: 宋体;"><br/></span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">可转债资产可在个人中心中查看。</span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;"></span> </p><p style="text-align: center; text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;"><img title="1484810221235104.png" alt="在个人中心中查看.png" src="/upload/201701/19/1484810221235104.png"/></span></p>', '', '', '', 0, 0, 0, '', 1483957837),
	(14, 14, '苹果资产说明', '苹果资产说明', '<p><span style="font-size: 18px;"><strong>    </strong><strong><span style="font-family: 宋体;">苹果资产是什么？</span></strong></span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">苹果资产是用于记录苹果积分、苹果金、苹果乐园养护进度，以及苹果积分分红率明细的专属账户。其中——</span></p><p style="text-indent: 28px;"><span style="font-size: 18px;">1<span style="font-family: 宋体; font-size: 18px;">、苹果积分是指在“老鼠爱大米”的某些模块中通过消费获得的积分，可用于计算积分分红率和生成苹果金，它只增不减、永远存在。</span></span></p><p style="text-indent: 28px;"><span style="font-size: 18px;">2<span style="font-family: 宋体; font-size: 18px;">、苹果金是由苹果积分计算生成的收益。</span></span></p><p style="text-indent: 28px;"><span style="font-size: 18px;">3<span style="font-family: 宋体; font-size: 18px;">、苹果乐园养护进度是用户在“苹果乐园”累积消费米币所达到的养护值。</span></span></p><p style="text-indent: 28px;"><span style="font-size: 18px;">4<span style="font-family: 宋体; font-size: 18px;">、苹果积分分红率是根据养护值所产生的分红率。</span></span></p><p><span style="font-size: 18px;"> </span></p><p><span style="font-size: 18px;"><strong>    </strong><strong><span style="font-family: 宋体; font-size: 18px;">积分宝商城与苹果资产的联系？</span></strong></span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">若您是原积分宝商城的用户，您的原“积分宝账户”、原“积分分红账户”将等比例转移到“老鼠爱大米”里，转化为“苹果积分”和“金币余额”。</span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">在“老鼠爱大米”项目内，通过积分分红率转换的资产，将生成苹果金。</span></p><p style="text-indent: 28px;"><span style="font-size: 18px;"> </span></p><p style="text-indent: 28px;"><span style="font-size: 18px;"><strong><span style="font-family: 宋体; font-size: 18px;">苹果金具体说明：</span></strong></span></p><p style="text-indent: 28px;"><span style="font-size: 18px;">1<span style="font-family: 宋体; font-size: 18px;">、苹果金计算：</span></span></p><p style="text-indent: 28px;"><span style="font-family: 宋体; font-size: 18px;">根据所获得的苹果积分，按照季度分红率进行计算所得，每笔均可实时获得！</span></p><p><span style="font-size: 18px;">    <span style="font-family: 宋体; font-size: 18px;">注：根据积分分红率，计算出本次分红收益：本次分红收益＝“苹果积分”×分红率－本季度已获得的分红收益。</span></span></p><p><span style="font-size: 18px;">        <span style="font-family: 宋体; font-size: 18px;">每次分红收益，大于等于</span>0.01<span style="font-family: 宋体; font-size: 18px;">部分进入苹果金，小于</span>0.01<span style="font-family: 宋体; font-size: 18px;">部分累计至下次分红收益。</span></span></p><p><span style="font-size: 18px;">        <span style="font-family: 宋体; font-size: 18px;">举例：“苹果积分”为</span>10200.5<span style="font-family: 宋体; font-size: 18px;">积分，分红率为</span>1%<span style="font-family: 宋体; font-size: 18px;">，本季度已获得</span>100<span style="font-family: 宋体; font-size: 18px;">金币分红收益，则本次分红收益＝</span>10200.5<span style="font-family: 宋体; font-size: 18px;">×</span>1%<span style="font-family: 宋体; font-size: 18px;">－</span>100<span style="font-family: 宋体; font-size: 18px;">＝</span>102.005<span style="font-family: 宋体; font-size: 18px;">金币，则本次分红收益有</span>102<span style="font-family: 宋体; font-size: 18px;">金币进入苹果金，剩余</span>0.005<span style="font-family: 宋体; font-size: 18px;">金币累计至下次分红收益。</span></span></p><p style="text-align: center;"><span style="font-size: 18px;"> <img title="1484810185872380.png" alt="苹果金计算.png" src="/upload/201701/19/1484810185872380.png"/></span></p><p style="text-indent: 28px; margin-left: 0px;"><span style="font-size: 18px;">2、<span style="font-family: 宋体; font-size: 18px;">苹果金用途：</span></span></p><p><span style="font-size: 18px;">    <span style="font-family: 宋体; font-size: 18px;">苹果金可用于购买商品时抵扣商品价格、认购可转债，以及提现等。</span></span></p><p style="text-indent: 28px;"><span style="font-size: 18px;"><span style="font-family: 宋体; font-size: 18px;">注：苹果金与金币、人民币的比例为：</span>1:1:1<span style="font-family: 宋体; font-size: 18px;">。</span></span></p><p><br/></p>', '', '', '', 0, 0, 1, '', 1484130119),
	(16, 1, '4050亿美元！全球央行抛美债速度创史上之最', '截至2016年11月底的12个月内，海外央行累计抛售美债规模达到4050亿美元，再次刷新历史记录。', '<p><span style="font-size: 18px;">　　美元越是强势，全球抛售美债所谓全球最安全资产的速度就越快！而这也将成为放在耶伦眼前最头痛的问题。<br/><br/>　　美国财政部最新发布的国际流动性报告显示，<strong>截至2016年11月底的12个月内，海外央行累计抛售美债规模达到4050亿美元，再次刷新历史记录。</strong>而截至10月底的12个月内，累计抛售的美债规模为4030亿美元。越来越多的迹象表明，不仅仅是中国，全球各央行、主权财富基金、基金经理以及其他持有美债的官方机构都在以前所未有的速度抛售美债。<br/></span></p><p><img src="/upload/201701/20/1484906011367400.jpg" title="1484906011367400.jpg" alt="11.jpg"/></p><p><br/><br/><span style="font-size: 18px;"><strong>　　中国领衔“清空美债”</strong><br/><br/>　　虽然11月<strong>日本减持了230亿美元的美债，为连续4个月卖出，但这次减持潮中要数中国抛售的力度最大，中国已经连续六个月减持美债，</strong>去年10月中国所持美债规模下降了413亿美元，成最大抛售者，而日本则自去年4月份以来首次反超中国，成为各大媒体口中的“美国头号债主”。<br/><br/></span></p><p><span style="font-size: 18px;">　　而11月，<strong>中国美债环比减少664亿美元，降至6年半最低水平1.0493万亿美元，减持规模环比增长60%，</strong><strong>降幅为2011年12月以来最大，</strong>日本连续两个月超过中国，继续保持美国海外最大债主的身份。</span></p><p><br/></p><p><img src="/upload/201701/20/1484906059105266.jpg" title="1484906059105266.jpg" alt="22.jpg"/></p><p><br/></p><p><span style="font-size: 18px;">　　2015年8月底，中国还掌控了1.48万亿美元的美国政府债务，<strong>据说其中一部分是存放在中国设置在比利时的托管账户之中，而现在的美债持有总额为1.05万亿美元。据悉，中国大量抛售美债的交易渠道主要包括中国直接抛售，以及通过比利时和瑞士的代理商进行减持。</strong>今年11月比利时所持美债规模也由1170亿美元降至1135亿美元，下滑35亿美元。</span></p><p><br/></p><p><img src="/upload/201701/20/1484906079547921.jpg" title="1484906079547921.jpg" alt="33.jpg"/></p><p><span style="font-size: 18px;">　　另外，根据央行数据显示，<strong>2016年11月中国外储下降691亿美元，降幅为2.2%，</strong>连续第五个月缩水，再创2016年1月以来最大单月降幅，整体规模降至2011年3月以来最低水平。<br/><br/>　　有意思的是，<strong>如果将中国和比利时所持美债加在一起，美债合计持有规模环比减少699(664+35=699)亿美元，减持幅度和当月中国外储减少数额非常接近。</strong><br/></span></p><p><img src="/upload/201701/20/1484906093656540.jpg" title="1484906093656540.jpg" alt="44.jpg"/><br/></p><p><span style="font-size: 18px;">　　国外金融网站Zerohedge表示，中国设在比利时的离岸托管账户可以帮助央行隐藏美债持有和外汇储备之间的关联，<strong>而且考虑到12月持续减少的外储，几乎可以认定中国在12月也抛售了大量美债，其规模应该与减少的外储相符，根据官方数据，12月，中国外储环比下降410亿美元。</strong></span></p><p><br/><span style="font-size: 18px;">　　但奇怪的是，有一个趋势似乎在发生转变，就是美债抛售大国沙特阿拉伯在过去的两个月里分别增持了30亿美元和107亿美元的美债，创2006年7月以来最大增持。<br/><br/>　　不管怎样，最令人不安的还是，不仅仅是中国还是日本，<strong>所有外国央行都在加速抛售美债，11月总抛售规模为708亿美元，为史上单月最大减持。目前，外国央行持有的美债为3.771万亿美元，远远低于去年同期的4.117万亿美元。<br/></strong><br/>　　也就是说，<strong>美债在以每年8.4%的比率下降，再次刷新了历史</strong>(不过这里，美国人不应该怪俄罗斯，因为普京在11月实际上增持了120亿美元的美债).<br/></span></p><p><img src="/upload/201701/20/1484906112370260.jpg" title="1484906112370260.jpg" alt="55.jpg"/><br/></p><p><span style="font-size: 18px;">　　毋庸置疑，全球央行都在以令人不安的节奏清算手中持有的美债，纵使最近美债收益率呈现出上升的趋势，所以美债的“买与卖”就需要更加谨慎的思考。</span></p><p><br/><span style="font-size: 18px;">　　在某些情况下，一些非美元国家的目的跟中国是一样的，就是为了缓解货币贬值压力，而其它国家尤其是石油出口国，是为了抵消石油美元崩溃所带来的风险，同时是为了填补本国高涨的财政赤字，但奇怪的是沙特在过去两个月在增持美债。<br/><br/>　　<strong>但最重要的一点是，这也表明了全球央行都在担心，在特朗普政府的财政刺激下，未来美国可能会出现债务发行的高峰。</strong><br/></span></p><p><br/></p><p><br/></p><p><br/></p><p><span style="font-size: 18px;"><strong>　　央行何时再买入？</strong><br/><br/>　　那这些抛出的债券由谁来接盘呢？<br/><br/>　　至少直到去年8月主要是个人需求在支撑着，换句话说就像是股市中的散户一样，这些来自国内外的个人投资者正在成为最终的接盘侠。所以当涉及到美国国债，“个人投资者”正在吸收上百亿央行持有的美债。<br/><br/>　　此前我们也有说过，我们也不知道，当这些“散户”意识到自己正在为国接盘时，他们将如何应对。<br/><br/>　　而几个月前，这一情况也有所改变，<strong>在9月份，“其它外国投资者”出售了高达310亿美元的美债，是个人和机构的总流出量达到766亿美元，为史上第二大流出规模。10月份，当所有外国官方机构抛售了450亿美元之后，至少个人投资者的抛售节奏有所放缓，“只有”183亿美元。</strong><strong>然而，在11月份，这一趋势似乎再次出现扭转，个人投资者买入了7.31亿美元的美债，难道他们知道一些央行所不知道的信息？</strong><br/><br/>　　与此同时，虽然美债收益率在5个月前已经跌至历史低点，但情况开始出现逆转，长期收益率的上升反而成为了市场的一大风险因素，因为欧央行和日央行可能会收紧对长期国债的购买规模，而且特朗普可能会释放1万亿美元的债务海啸。<br/><br/>　　虽然不清楚在什么情况下外国买家会再次回归美债，毕竟美债收益率已经跳升至具有足够吸引力的水平，但有一点是明显的：鉴于此刻全球清空美债的速度有增无减，耶伦可能需要马上计划一下如何才能让她的加息计划对全球长债收益率不产生上行压力，而且还要想想如何吸收过量的美债供应。</span></p>', '', '', '', 0, 0, 1, '', 1484906321),
	(17, 1, '任泽平：2017年股市结构性机会多 布局两大主线', '从股市方面来说，2017年股票市场将从水牛转向业绩牛，没有指数级机会，但结构性机会比较多，将围绕着改革和业绩两大主线展开。', '<p><span style="font-size: 18px;">　　2017年股市将从水牛转向业绩牛，没有指数级机会，但结构性机会比较多，将围绕着改革和业绩两大主线展开。房价将调整到2017年底乃至2018年。人民币将继续修正高估。</span></p><p><br/></p><p><span style="font-size: 18px;">　　展望2017年，我预计GDP将增长6.5%左右，CPI将增长2%左右。经济将在二季度前后二次探底，但回调幅度不深。通胀在一季度见顶回落，但全年处于温和通胀环境。<br/></span></p><p><br/><span style="font-size: 18px;">　　虽然宏观经济在需求端二次探底，但供给出清和行业集中度提升将有助于改善企业效益，2017年去产能将加码扩围，剩者为王。<br/><br/>　　对于房地产行业来说，去年国庆期间调控政策密集出台，10-11月房地产销量大幅回调，考虑到从销量到投资的传导时滞为6个月左右，房地产投资的回落可能要到2017年二季度前后。但是，我预计这一轮房地产投资回调幅度可能不深，预计2017年房地产投资增速2%左右。<br/><br/>　　2016年12月中央经济工作会议召开，部署2017年经济工作。从政策方面来说，2017年财政政策从稳增长转向防风险和促改革，财政扩张力度或不及2016年。货币政策从宽松转向中性稳健。同时，会议强调，将防风险放在更加重要的位置，从加杠杆步入去杠杆周期。<br/><br/>　　供给侧结构性改革“三去一降一补”深入推进，企业效益继续改善，重大投资机会凸显。深入推进农业供给侧结构性改革，2017年农产品种植结构、收储制度、土地轮休、土地制度等改革有望推进，成本上涨和供给侧去库存将推动农产品价格上涨，土地流转和规模化经营将提升农业生产效率。<br/><br/>　　国企改革方面，2015年中央经济工作会议的论述为“要大力推进国有企业改革，加快改组组建国有资本投资、运营公司，加快推进垄断行业改革”，2016年则变为“混合所有制改革是国企改革的重要突破口，按照完善治理、强化激励、突出主业、提高效率的要求，在电力、石油、天然气、铁路、民航、电信、军工等领域迈出实质性步伐”。表明中央把混改提到十分重要的位置，类似联通的混改方案有望在其他行业领域取得重大突破。<br/><br/>　　具体到大类资产配置方面，首先，从股市方面来说，2017年股票市场将从水牛转向业绩牛，没有指数级机会，但结构性机会比较多，将围绕着改革和业绩两大主线展开。<br/><br/>　　第一条主线是受益于改革的，比如农业供给侧改革、国企混改、军工、去产能加码扩围、一带一路、PPP等。<br/><br/>　　第二条主线是业绩超预期的，比如价值股中供给出清充分和行业集中度提高的，成长股中用业绩证明自己的，比如受益于通胀、利率不敏感的行业有农业、食品饮料、公用事业、石化、银行、黄金等。<br/><br/>　　债市方面，去杠杆带来大起大落，2017年中期经济通胀下行为债市带来交易性机会。2017年出口和制造业投资会改善，但房地产投资和库存会变差，经济通胀可能在2-3季度前后重回下行通道，将为债市提供基本面环境。<br/><br/>　　房市方面，本轮房价调整可能会持续到2017年底至2018年上半年，关键看长效机制。由于当前调控主要是通过限购限贷控制需求，如果土地供给跟不上和长效机制建立不理想，2017年底至2018年上半年房价面临新一轮上涨压力。如果长效机制能够建立，尚有转机。<br/><br/>　　汇率方面，人民币贬值最根本的原因是前期货币超发和改革迟缓，中期仍有贬值压力，货币当局面临保汇率、保外储和保房价的新不可能三角。在短期虽然央行干预可以起到阶段性稳汇率的效果，但也付出外储消耗、加强管制、高估压力仍存的代价。<br/><br/>　　黄金方面，如果2017年特朗普新政遇阻，美国经济复苏和通胀不及预期，美元有望回调，黄金可能反弹；反之则美元走强，黄金可能延续下跌。</span></p>', '', '', '', 0, 0, 1, '', 1484906862),
	(18, 1, '证监会：IPO审核范围将更严格 限制频繁再融资', '证监会新闻发言人20日表示，IPO审核范围将更加严格，上市公司再融资目前存在问题。', '<p><span style="font-size: 18px;">　　1月20日，中国证监会召开新闻发布会。证监会发言人张晓军就近期市场传闻再融资收紧、上市公司过度减持等问题表示：<br/><br/><strong>　　证监会：IPO审核范围更加严格</strong><br/><br/>　　修订完善发行审核的履职回避制度其中，IPO审核范围更加严格，包括配偶、子女等。再融资申请企业，亲属是5%持股以上的审核人员，也要回避。<br/><br/>　<strong>　证监会：上市公司再融资目前存在问题</strong><br/><br/>　　上市公司再融资目前存在问题，再融资的问题表现在部分公司过度融资、结构不合理。将采取措施限制上市公司频繁融资或单次融资金额过大。<br/><br/>　　<strong>证监会：严查涉嫌内幕交易操纵市场大股东减持行为</strong><br/><br/>　　上市公司并购重组存在投机炒壳的顽疾，将加强监管。中国证监会表示严格查处涉嫌内幕交易操纵市场的大股东减持行为。<br/><br/>　<strong>　证监会：将进一步加强并购重组监管</strong><br/><br/>　　上市公司并购重组秩序尚不规范，存在投机炒壳的痼疾顽疾，以及忽悠式跟风式和盲目跨界重组的问题。证监会下一步将进一步加强并购重组监管，持续完善相关业务规则，引导资金更多投向有利于产业整合升级的方向，趋利避害，更好发挥并购重组的积极作用。<br/><br/>　<strong>　证监会对4宗案件作出行政处罚涉及多家上市公司</strong><br/><br/>　　证监会依法对4宗案件作出行政处罚，其中包括一宗内幕交易案，一宗内幕交易及短线交易案，一宗中介机构违法违规案，一宗利用未公开信息交易案。<br/><br/>　<strong>　2016年证监会行政处罚涉讼案件43件连续三年创历史新高</strong><br/><br/>　　2016年证监会行政处罚涉诉案件共43件，连续三年创造历史新高。法院对涉及证监会行政处罚的24件案件作出判决或裁定，其中胜诉16件，原告主动撤诉6件，一审败诉2件。对一审败诉案件，证监会已依法提起上诉。<br/><br/>　<strong>　证监会明确发行审核预约接待三大情况：沟通规范进一步强化<br/></strong><br/>　　明确了沟通事项，对需要当面沟通的事项可以当面沟通，反馈意见的重大问题需要当面进行解释说明，咨询政策和审核标准和需要当面沟通的其他情况。其他问题鼓励通过电子邮件、电话形式沟通。对于与发行业务无关的来访，明确不属于沟通范围。<br/><br/><strong>　　证监会：上市公司并购重组存在投机炒壳的顽疾将加强监管</strong><br/><br/>　　并购重组是支持实体经济的重要手段，但是存在投机炒壳的顽疾。去年9月，证监会修订发布了并购重组管理办法，有力的遏制投机炒壳和关联人减持套利，同时对并购配套融资进行严格限制。<br/><br/><strong>　　证监会：两公司因IPO现场检查被移送稽查部门</strong><br/><br/>　　证监会对其中发现问题的两家企业：圣元环保股份有限公司、上海基美文化传媒股份有限公司，已经移送稽查部门处理。<br/><br/><strong>　　证监会修订完善发行审核履职回避制度</strong><br/><br/>　　近期证监会发布了2017年1号公告，修订完善发行审核履职回避制度。修订后的制度，从严并细化了涉及亲属的回避制度，使得发行审核工作人员履职回避时没有“死角”。<br/><br/>　　<strong>证监会：将进一步加强对公司债券发行事中事后监管</strong><br/><br/>　　2016年下半年，证监会组织相关证监局对四类发行人专项检查：一是类平台发行人，二是主要业务在三四线城市的房地产发行人，三是应收账款比较大的发行人，四是2015年年报中发现比较大的问题，需要现场检查的发行人。一共检查发行人157家，以问题和风险为导向，发现的问题主要包括两个方面：一类是募集资金管理使用方面的问题，第二类是信息披露的问题。</span></p>', '', '', '', 0, 0, 1, '', 1484907020),
	(19, 1, '美联储告别宽松 全球流动性承压', '', '<p><span style="font-size: 18px;"> 　尽管早前美联储加息的预期已经长时间地左右和影响债市、汇市，但加息靴子落地后，市场依旧掀起巨大波澜。美元指数疾走冲高，美债收益率明显上扬，非美货币则全线下滑。<br/><br/>　　在美联储位于宪法大道的总部内，几乎所有人都相信长久以来使美国经济增长放缓的逆风正在减弱，是时候开始收紧货币政策。在2016年最后一次政策会议纪要中，美联储官员们表示如果2017年国会通过提振经济的减税方案，他们可能会将利息升高至超出预期的程度。<br/><br/><br/>　　美国总统大选的结果对美联储而言是个转折。此前，特朗普承诺通过减税和增加基础设施建设支出来改变美国经济，意味着经济增长将不再过度倚仗低利率。<br/><br/>　　这与全球央行的逻辑出入很大。为了刺激经济增长，全球主要央行使出浑身解数，将短期利率降至极低甚至为负的水平，同时进行资产购买，推高金融资产价格。尽管在宽松政策上，不少央行已经显露出疲态，但包括英国在内，也并没有选择实质性收紧。<br/><br/>　　美联储是世界主要央行中率先上演反转行动的。当地时间2016年12月14日，美联储全票通过了加息25个基点的方案，这是十年来美联储的第二次加息。政策会议点阵图另预计今年还会有三次加息。如果按照这个计划进行，那么在年底前联邦基金利率会达到1.375%的水平，这是2008年9月雷曼破产以来从未有过的。<br/><br/>　　尽管早前美联储加息的预期已经长时间地左右和影响债市、汇市，但在充分预期的加息靴子落地后，市场依旧掀起巨大波澜。美元指数疾走冲高，美债收益率明显上扬，非美货币全线下滑。<br/><br/>　　因为相较过往，美联储这次明显更偏鹰派。与2015年不同，本次加息具备了美国财政积极预期的配合，美元指数得以更为强势，一度刷新14年高位，非美货币悉数走软。其中，日元跌幅最甚，突破117关口，创近十个月新高，欧元对美元跌幅扩大至113点，离岸人民币对美元一度逼近整数关口，在全球各国货币政策互联性加强的背景下，汇率承压令欧日及新兴市场面临严峻的资金流出局面。<br/><br/>　　对于全球流动性而言，美联储货币政策的变化影响深远。无疑，加息将诱发跨境资金在资产板块之间、区域板块之间大幅流动，驱动全球跨境资金回流至美国市场，而对国际“热钱”依赖度较高的新兴经济体在短期内则可能遭受大量资本外流的冲击，“抽水”较为严重，促使全球流动性面临拐点。<br/><br/>　　作为全球最重要的中央银行之一，美联储的加息动作在实质上相当于减少全球流动性，因在美元持续走强的格局下，全球金融市场借贷成本会相应提高，偿债负担增加。同时，由于风险规避、获利预期、偿付外债等原因，私人部门投融资活动从欧元区、新兴市场向美国输入，这种流动性格局转变将触发资产价格下跌—流动性收紧的螺旋效应，并从新兴市场、欧元区向全球蔓延，推动资产价格重估，而资产价格下跌将引发机构争相抛售资产、倒逼私人部门去杠杆，这又促使全球流动性进一步收紧，政策空间受到挤压。此外，美元升值还将压低<br/><br/>　　国际大宗商品价格，严重依赖大宗商品出口的新兴经济体将面临国际收支失衡风险，并进一步削弱其外债偿债能力。<br/><br/>　　即使未来各大央行存在逐渐退出宽松政策的可能，但微观层面私人部门流动性创造行为的改变，依旧可在宏观层面产生巨大的流动性紧缩效应。但就目前情况看，除美联储外，全球主要央行并未将退出宽松提上日程，意味着在可预见的将来，美国与全球主要经济体的货币政策分化将进一步加剧。<br/><br/>　　例如，为对抗通货紧缩和经济低迷，欧日央行目前还处于“你加你的息，我放我的水”的状态，于上年末先后调整了购债结构，欧央行将购债范围放宽至更短期债券，日央行则将量化宽松的目标从“量”转向“价”，以保证量化宽松的空间，其他主要新兴经济体也均在应对经济放缓的过程中倚重宽松货币政策。反观美联储，不仅已退出量化宽松，且已开启加息周期。<br/><br/>　　过去几十年，新兴市场金融危机大多发生在美联储货币政策紧缩周期，流动性变化极易导致资产价格和汇率大幅波动，诱发系统性风险。为缓解美国加息带来的冲击，墨西哥央行宣布大幅加息50个基点，以稳定汇率、防止通胀风险，但需要付出的代价是融资成本大幅上涨，这无疑会对本国经济增长形成拖累。由此可见，简单的选择跟进加息并不是解决根本性问题的方法。若要减缓全球流动性变化对金融稳定的冲击，各国央行不仅需要把握本国货币政策的节奏，也需要加强他国央行的协同，让市场逐步消化加息压力。<br/><br/>　　目前的市场共识是美国将进入“紧货币、宽财政”的政策组合，而从历史角度看，过去美联储处于货币政策收紧周期与财政政策积极加码很少同时出现。因此，特朗普的财政政策更像是一次为突破“低利率、低增长、低通胀”大环境的尝试，意味着政策制定者们将进入一个由美联储和特朗普共同主导的新时代。唯存的悬念在于，耶伦保持着一如既往的矜持。对于特朗普可能带来的政策变化，耶伦表示需要“再等等看”。要知道，2017年可能是她留任美联储的最后一年。</span></p>', '', '', '', 0, 0, 1, '', 1485156962),
	(20, 1, '人社部：将稳慎推进基本养老保险基金投资运营', '', '<p><span style="font-size: 18px;">        人力资源和社会保障部定于1月23日(周一)10:00在西院216会议室举行2016年四季度新闻发布会。国家人社部政策研究司副司长、新闻发言人卢爱红今日在新闻发布会上表示，下一步将加强社保基金监督管理。加强社会监督队伍建设，完善社会监督与行政监督衔接工作机制。加强与公安机关的协作，健全社保欺诈案件查处移送机制，依法及时移送违法犯罪案件。稳慎推进基本养老保险基金投资运营，多措并举增强基金支撑能力。<br/><br/>　　<strong>发布会实录：</strong><br/><br/>　　国家人社部政策研究司副司长卢爱红：<br/><br/>　　各位新闻界的朋友，大家上午好！由于工作调整，我部的李忠同志任人力资源和社会保障部办公厅主任，不再担任新闻发言人。我是政策研究司卢爱红，很高兴和大家见面。<br/><br/>　　2008年人力资源和社会保障部组建以来，我们建立了新闻发言人制度，开展季度例行新闻发布和专题新闻发布。这些年来，我们和新闻媒体保持了良好的沟通和交流，新闻发布工作得到了各方面的支持和帮助。在此，对媒体朋友们表示感谢！我作为人力资源和社会保障部新闻发言人，首次和大家见面，希望得到媒体朋友们的继续支持，我也愿意和大家继续保持良好的沟通和交流，共同推进人力资源和社会保障事业的健康发展。<br/><br/>　　下面按照惯例，我先介绍一下2016年工作情况和2017年的主要安排。<br/><br/>　　2016年，各级人力资源社会保障部门认真贯彻落实党中央、国务院的决策部署，开拓进取，狠抓落实，各项工作取得积极进展。<br/><br/>　　一、就业<br/><br/>　　工作进展情况：就业局势保持总体稳定。2016年，全国城镇新增就业1314万人，城镇失业人员再就业554万人，就业困难人员实现就业169万人，超额完成全年目标任务。四季度末全国城镇登记失业率为4.02%，低于4.5%的年度调控目标。<br/><br/>　　一是重点群体就业平稳推进。组织实施高校毕业生就业创业促进计划，深入实施高校毕业生“三支一扶”计划，引导和鼓励高校毕业生到基层工作，高校毕业生就业形势总体平稳。扎实做好钢铁煤炭行业化解过剩产能职工安置工作，摸清底数，强化服务，加强分类指导，加强突发事件预防和处置，职工安置工作平稳有序开展。加强就业援助，确保零就业家庭实现动态清零。出台切实做好就业扶贫工作的指导意见，通过劳务协作试点、技能脱贫、创建就业“扶贫车间”等多种形式，扎实做好农村贫困劳动力转移就业工作。<br/><br/>　　二是创业带动就业成效明显。深入推进创业孵化基地建设，积极开展“双创活动周”、“中国创翼”青年创业创新大赛等活动。实施三年行动计划，促进更多农民工返乡就业创业。<br/><br/>　　三是公共就业服务进一步加强。出台加快推进公共就业服务信息化建设应用指导意见，人力资源市场整合步伐加快，公共就业服务能力和水平明显增强。推进人力资源服务业快速发展，创新人力资源市场事中事后监管方式，市场在促进就业中的作用进一步发挥。同时，加大职业培训工作力度，实施职业培训行动计划，劳动者素质得到进一步提高。<br/><br/>　　2017年工作安排：一是完善落实稳定和扩大就业的政策。通过产业、财税、金融、贸易等一揽子政策协同配合，推动经济增长带动就业，扶持新就业形态发展，不断拓展就业新空间。加强政策宣传、督促检查、效果评估，推动政策落地见效。<br/><br/>　　二是做好重点群体就业工作。深入实施高校毕业生就业创业促进计划，落实新一轮高校毕业生“三支一扶”计划，进一步引导和鼓励高校毕业生到基层工作，多渠道促进高校毕业生就业创业。积极稳妥做好化解过剩产能职工安置工作。开展就业援助专项行动，发挥失业保险援企稳岗作用，确保零就业家庭动态清零。提高就业扶贫精准度，促进农村贫困劳动力就业，带动促进贫困人口脱贫。<br/><br/>　　三是突出抓好创业带动就业工作。加强创业服务和创业培训，推进创业孵化示范基地建设，积极开展各类创业创新活动，营造鼓励创业创新的社会氛围。<br/><br/>　　四是大力加强职业技能培训。开展专项职业培训行动，落实培训补贴政策，创新培训模式，整合资源、提高效能，进一步增强职业培训的针对性和实效性，提高劳动者就业和转岗能力。<br/><br/>　　五是加强公共就业服务。提高公共就业创业服务专业化、标准化水平，加强就业信息化建设和应用，完善劳动力资源管理信息监测体系，进一步提升服务能力和管理水平。创新人力资源市场事中事后监管方式，推进人力资源服务业发展。同时，密切关注经济和就业形势变化，加强就业失业动态监测，完善失业风险预警和快速响应工作机制，努力防范失业风险。<br/><br/>　　二、社会保障<br/><br/>　　工作进展情况：一是社会保险覆盖范围持续扩大。加快实施全民参保计划，积极开展扩面征缴工作，截至2016年底，基本养老、基本医疗、失业、工伤、生育保险参保人数分别达到8.9亿人、7.5亿人、1.8亿人、2.2亿人、1.8亿人；五项基金总收入为5.3万亿元，同比增长14.7%，总支出为4.7万亿元，同比增长19.3%。<br/><br/>　　二是社会保障制度不断完善。阶段性降低基本养老保险单位缴费费率和失业保险费率，进一步降低企业成本。全面实施机关事业单位养老保险制度，研究制定相关配套政策。整合城乡居民基本医疗保险制度，30个省区市和新疆生产建设兵团出台整合制度相关文件。推进大病保险全覆盖，出台生育保险和医疗保险合并实施的办法，开展长期护理保险制度试点。完善工伤保险条例配套政策，制定工伤保险辅助器具配置管理办法。<br/><br/>　　三是待遇水平不断提高。实现企业和机关事业单位养老金待遇同步调整，1亿多退休人员受益。提高城乡居民基本医疗保险补助标准，达到人均420元。<br/><br/>　　四是经办管理服务和基金投资管理工作进一步加强。医保全国联网和跨省异地就医直接结算工作取得积极进展。推广社会保障卡发行和应用，社会保障卡持卡人数达到9.72亿人。正式启动基本养老保险基金投资管理，印发职业年金基金管理暂行办法。我国在覆盖城乡社会保障体系建设中取得的成就获得国际社会充分肯定和高度评价，国际社会保障协会授予中国政府“社会保障杰出成就奖”。<br/><br/>　　下一步工作安排：一是完善社会保障制度。出台实施完善基本养老保险制度总体方案。出台实施企业年金办法。深入推进机关事业单位养老保险制度改革。认真落实全国卫生与健康大会决策部署，推进“三医联动”，积极推进医保支付方式改革，加强医保基金预算管理，推进按病种付费等多种支付方式，强化对医疗行为的监管。改进医疗保险个人账户，积极开展门诊费用统筹。全面推进城乡居民医保整合。开展长期护理保险试点和医疗保险与生育保险合并实施试点工作。积极推进工伤保险省级统筹。稳步提高社会保障待遇水平。<br/><br/>　　二是提升社会保险经办管理服务能力。加快建立国家异地就医联网结算系统，确保今年基本实现符合转诊规定的异地就医住院费用直接结算。深入推进“五证合一”登记制度改革。健全社保经办服务标准化体系。创新管理手段和服务方式，加快电子社保建设步伐，提高社保经办规范化、信息化、专业化水平。全面实施全民参保计划，基本建成全国全民参保数据库。确保养老金按时足额发放。<br/><br/>　　三是加强社保基金监督管理。加强社会监督队伍建设，完善社会监督与行政监督衔接工作机制。加强与公安机关的协作，健全社保欺诈案件查处移送机制，依法及时移送违法犯罪案件。稳慎推进基本养老保险基金投资运营，多措并举增强基金支撑能力。<br/><br/>　　三、人才队伍建设<br/><br/>　　工作进展情况：一是深化人才评价机制改革。建立适合不同人才成长规律和实际特点的评价机制，印发关于深化职称制度改革意见，分类推进人才评价机制改革。深入落实国务院转变政府职能、推进“放管服”改革任务要求，大幅削减职业资格许可和认定事项，在前五批已取消272项国务院部门设置的职业资格基础上，又分两批取消职业资格161项，总计取消433项，完成国务院确定取消70%的目标，各地也都取消了一批自行设置的职业资格，人才负担和制度性成本持续降低。研究制定国家职业资格目录清单管理制度，提出国家职业资格目录清单，职业资格规范化管理进一步加强。<br/><br/>　　二是专业技术人才队伍建设取得新进展。高层次人才选拔培养工作有序实施，开展“万人计划”百千万工程领军人才、享受政府特殊津贴专家选拔工作，实施万名专家服务基层行动计划。做好留学回国人员服务工作，实施高层次留学人才回国资助、海外赤子为国服务行动计划。贯彻落实国务院办公厅关于改革完善博士后制度的意见，实施博士后创新人才支持计划。实施专业技术人才知识更新工程，完成急需紧缺人才培养和岗位培训127.35万人次。<br/><br/>　　三是技能人才队伍建设不断加强。大力弘扬“工匠精神”，隆重表彰了30名中华技能大奖获得者和299名全国技术能手，突出宣传了一批优秀技能人才的典型。高技能人才振兴计划深入实施，制定技工教育“十三五”规划，技工院校改革发展推向深入，校企合作广泛开展，企业新型学徒制试点取得成效，各类技能竞赛规模扩大，全年新增高技能人才290万人。<br/><br/>　　下一步工作安排：一是全面深化职称制度改革，加快制定配套政策，积极稳妥实施。扎实做好分类推进人才评价机制改革工作，分类建立符合不同人才成长规律和实际特点的评价机制。建立国家职业资格目录清单管理制度，清单外一律不得许可和认定职业资格，清单内除准入类职业资格外一律不得与就业创业挂钩。<br/><br/>　　二是加强专业技术人才队伍建设。加强高层次人才培养选拔，大力引进“高精尖缺”人才，实施专业技术人才知识更新工程、百千万人才工程、万名专家服务基层行动计划、新疆西藏特培计划等重点人才项目。实施好博士后创新人才支持计划、留学人员回国创新创业启动支持计划。<br/><br/>　　三是加强技能人才队伍建设。研究完善技能人才职业技能等级认定和提高待遇政策，畅通技能人才职业发展通道。实施国家高技能人才振兴计划，加强高技能人才培训基地和技能大师工作室建设，推进企业新型学徒制、职业训练院、职业培训包等试点工作。实施农民工职业技能培训综合计划。做好第44届世界技能大赛参赛和第46届世界技能大赛申办工作。<br/><br/>　　四、事业单位人事管理<br/><br/>　　工作进展情况：研究制定事业单位工作人员奖励规定，出台做好艰苦边远地区县乡事业单位公开招聘工作的意见，探索建立机关事业单位防治“吃空饷”问题长效机制。<br/><br/>　　下一步工作安排：深入实施事业单位人事管理条例，研究出台考核、竞聘上岗规定，制定监督、培训相关配套政策，进一步完善公开招聘制度，制定事业单位公开招聘违纪违规行为处理办法。试点推行事业单位管理岗位职员等级晋升制度。促进事业单位专业技术人员创新创业，推动建立高校、科研院所和企业科研人员双向交流机制。<br/><br/>　　五、劳动关系<br/><br/>　　工作进展情况：一是劳动关系协调工作取得积极进展。积极稳妥做好化解过剩产能中的劳动关系处理工作。深入贯彻落实全面治理拖欠农民工工资问题的意见，开展专项行动，加强源头治理，保障农民工工资支付长效机制逐步健全。进一步健全协调劳动关系三方机制，深入推进集体合同制度实施攻坚计划。以农民工、小企业为重点，督促企业和职工依法签订劳动合同。<br/><br/>　　二是劳动人事争议调处机制不断完善。研究制定进一步加强劳动人事争议调解仲裁完善多元处理机制的意见。加强专业性劳动争议调解，推动乡镇(街道)劳动就业社会保障服务所(中心)调解组织建设，组建率达到90%以上。扎实推进劳动人事争议调解工作，将劳动争议预防调解示范工作由国有企业扩大到非公有制企业，调解仲裁效能进一步增强。<br/><br/>　　三是劳动保障监察执法进一步加强。制定出台重大劳动保障违法行为社会公布办法和企业劳动保障守法诚信等级评价办法，推动建立“双随机一公开”监管机制，加大对企业违法行为监督和惩戒力度，劳动保障监察执法成效明显。<br/><br/>　　四是为农民工服务工作进一步加强。组织开展第十次全国农民工工作督察。推动农民工逐步平等享受城镇基本公共服务，有序推进农民工市民化。扶持家政服务业发展，实施巾帼家政服务专项培训工程，举办全国巾帼家政服务职业大赛。<br/><br/>　　下一步工作安排：一是做好劳动关系协调工作。继续指导企业在化解过剩产能中依法妥善处理职工劳动关系，维护好分流安置职工合法权益。以工资集体协商为重点，健全集体协商和集体合同制度。进一步探索完善协调劳动关系三方机制，深入开展和谐劳动关系创建活动。<br/><br/>　　二是加强调解仲裁工作。进一步推进争议处理效能建设，加强专业性劳动争议预防调解工作，开展乡镇(街道)劳动就业社会保障服务所(中心)劳动争议调解组织综合示范工作。健全争议仲裁制度，完善仲裁办案规则，建立调解仲裁机构与司法审判调诉衔接、裁审衔接的工作机制。<br/><br/>　　三是加强劳动保障监察执法。积极推进劳动保障监察执法体制改革，加快建立“双随机一公开”机制，组织开展清理整顿人力资源市场秩序、用人单位遵守劳动用工和社会保险法律法规情况、农民工工资支付情况专项检查。推行劳动保障守法诚信等级评价，依法公布重大劳动保障违法行为，加大违法失信行为惩戒力度，维护劳动者合法权益。<br/><br/>　　四是加强为农民工服务工作。研究制定加强和规范农民工综合服务平台建设的措施。加快家庭服务标准的制修订工作。推动家庭服务诚信信息平台建设。<br/><br/>　　以上是我向大家介绍的2016年主要工作进展情况和下一步的主要工作安排。按照惯例，介绍完情况之后请大家提问，我们进行交流。提问前，请大家先自报家门。下面请大家提问。<br/><br/>　　经济日报记者：<br/><br/>　　总体来看，今年我国经济下行压力还是比较大的，特别是产能过剩，需求侧的结构矛盾突出，您如何看待今年就业形势？<br/><br/>　　卢爱红：<br/><br/>　　就业历来是大家都比较关心的问题，这是一件大事，在整个经济社会发展中具有非常重要的地位和作用。中国是人口大国，劳动力资源丰富，就业问题始终是党和政府高度重视的一个重大问题。总体判断，今年的就业形势总体稳定的基本面没有变，但是稳中有忧。可以从两个方面来看：<br/><br/>　　第一，从总量上看。2012年以来，中国劳动年龄人口呈现总量持续下降的趋势，但是由于受教育等因素的影响，劳动者进入劳动力市场存在滞后期，所以目前城镇新增劳动力仍然处于高位，农业转移劳动力仍然保持一定的规模。所以我们说，今年就业总量的压力依然比较大。<br/><br/>　　第二，从结构上看。就业结构性矛盾更加突出，这也是这些年来非常明显的趋势和特点。体现在招工难和就业难的情况并存，有一些企业很难招到技能人才、高层次人才，也有些劳动者很难实现稳定就业。同时，还有一个新的特点，区域、行业、企业就业情况的分化趋势也在凸显，结构性和摩擦性失业增多，特别是这两年过剩产能加速出清，职工安置的任务非常繁重。今年的就业形势仍然还是很严峻。加上国际形势复杂多变，国内经济下行压力在持续加大，结构调整深入推进，今年就业工作任务依然繁重艰巨。<br/><br/>　　同时，也要看到，党中央、国务院高度重视就业工作，把就业工作放到经济社会发展的全局去考虑、去推进。1月18日，国务院常务会议审议通过了“十三五”促进就业规划，明确要求把实施积极的就业政策摆在更加突出的位置，切实推动稳定和扩大就业，打造高素质劳动者队伍，这为我们做好就业工作提供了行动指南。<br/><br/>　　促进就业也有许多积极因素和有利条件，比如说经济发展向好的基本面没有变，这是中国经济的一个大趋势。我国经济发展仍处于合理区间，经济总量增大、经济结构优化，以及商事制度改革、简政放权等改革所带来的红利持续释放，还包括新型城镇化、“一带一路”等重大战略部署的推进实施，特别是“双创”蓬勃发展，新技术、新业态的不断涌现，也都将进一步拓展就业增长空间，对就业的拉动能力进一步增强。<br/><br/>　　还有就业政策措施日趋完善，从2002年我们确立中国特色积极就业政策以来，针对不同时期的就业工作特点、情况，不断丰富完善形成了一整套积极就业政策和扶持就业创业的政策体系。同时，我们职业培训和公共就业服务体系也不断加强和健全，促进就业的效果也进一步显现。这些都将为2017年就业局势总体稳定奠定坚实的基础。<br/><br/>　　就业是最大的民生，也是经济发展最基本的支撑。我们将深入贯彻党中央、国务院决策部署，坚持实施就业优先战略和更加积极的就业政策，完善落实稳定和扩大就业的政策，做好重点群体就业工作，突出抓好创业带动就业工作，大力加强职业技能培训和公共就业服务，确保就业局势保持总体稳定。<br/><br/>　　新华社记者：<br/><br/>　　城乡居民医保整合工作现在进展的情况如何？另外整合后报销的比例有什么变化？下一步工作重点是什么？<br/><br/>　　卢爱红：<br/><br/>　　城乡居民医保整合是社会保障体系的一项重大改革，是中央推出的一项重大的改革举措。这项改革对于健全体系、完善制度和夯实社会保障的基础，具有十分重要的意义。国务院关于整合城乡居民基本医疗保险制度的意见下发以后，各地狠抓贯彻落实，全面持续推进整合工作。<br/><br/>　　到去年底，全国已经有30个省区市和新疆生产建设兵团出台了制度整合的文件，作出了工作部署。其中有9个省份，包括天津、上海、浙江、山东、广东、重庆、宁夏、青海和新疆生产建设兵团，在国务院文件下发前，就全面整合建立了统一的制度。有22个省份在国务院文件下发后，新出台文件，明确整合制度的基本政策，实现“六个统一”。其中河北、湖北、内蒙古、江西、新疆、北京、湖南、广西、云南、河南、山西、黑龙江、江苏13个省份，加上之前已经实现整合的9个省份，还理顺了管理体制，全民医保三项制度统一由人社部门管理，实现整个医疗保险一体化运行与社会化管理服务。<br/><br/>　　目前从已经整合的地方实践看，制度整合成效显著。各地普遍按照缴费就低不就高，待遇就高不就低，目录就宽不就窄的思路，居民医保制度的公平性显著增强，特别是农村居民医疗服务利用水平与保障水平普遍提高，群众普遍得到实惠，改革的获得感进一步增强。同时，制度整合也增强了医保基金的互助共济能力，下一步我们将重点推进统筹地区继续做好制度整合工作。<br/><br/>　　中央电视台记者：<br/><br/>　　我的问题还是关于就业。2017年高校毕业生数量再创历史新高，预计将达到795万，就业难度是不是更大了？国家将有哪些措施促进高校毕业生就业？<br/><br/>　　卢爱红：<br/><br/>　　青年就业是世界性的难题，对我国来说尤其突出。我国青年就业的重点主要是高校毕业生。高校毕业生是国家宝贵的人才资源，从国家长远发展看，促进高校毕业生就业是推进产业转型升级的希望所在，也是技术进步、创新创业的重要人才支撑。党和政府高度重视高校毕业生就业工作，把高校毕业生就业工作作为整个就业工作的重中之重，摆在突出的位置来研究部署推进。这些年来，国家出台了一系列政策措施，国务院每年专门召开会议进行部署，各地区、各部门密切配合，做了大量工作，狠抓政策落实。<br/><br/>　　从去年的情况看，高校毕业生就业总体稳定，就业水平同2015年基本持平，总体就业形势是平稳的。今年高校毕业生将达到795万人，差不多占城镇新成长劳动力的一半还多，就业任务非常繁重。在这样的形势下，人社部门将进一步采取更加有力的措施，针对新情况采取新的措施，研究制定新的政策，会同有关部门加大工作推进力度，千方百计促进高校毕业生就业创业。<br/><br/>　　主要有以下三个方面的措施：第一，继续完善和落实高校毕业生就业创业扶持政策，引导和鼓励高校毕业生到基层工作，健全服务保障机制，进一步拓宽高校毕业生就业渠道。<br/><br/>　　第二，深入实施高校毕业生就业创业促进计划。开展能力提升、创业引领、校园精准服务、就业帮扶、权益保护五项行动，对就业困难毕业生，还要提供“一人一策”的专项帮扶，促进更多高校毕业生就业创业。<br/><br/>　　第三，加强有针对性的就业服务。重点是根据高校毕业生不同时期求职就业的特点和需求，组织开展各类就业服务专项活动，组织开展专业性、行业性、跨区域的招聘活动，提升就业服务信息化水平，更好促进高校毕业生与用人单位对接。<br/><br/>　　中国青年报记者：<br/><br/>　　我们都知道，第44届世界技能大赛将在阿联酋举办，请您从场地、资金、投入、选手选拔等方面介绍一下筹备的有关情况。中国这次有什么预期的目标吗？<br/><br/>　　卢爱红：<br/><br/>　　世界技能大赛是最高层次的世界性职业技能比赛，也被称为“技能奥林匹克”，是最高水平的展示。我国从2011年开始连续参加了三届世界技能大赛，成绩都不错。特别是2015年在巴西圣保罗举办的第43届大赛上，取得了5块金牌、6块银牌、4块铜牌和11个优胜奖的优异成绩。<br/><br/>　　参加世界技能大赛的意义在于，有利于推动我国人才队伍建设，有利于展示我国青年技能人才的风采，也有利于展示我国经济社会发展取得的成就，提升国家的影响力。今年10月份，将在阿联酋举办第44届大赛，对参加今年的大赛工作，党中央、国务院高度重视。这是一项非常精细的工作，我部会同有关方面做了大量的准备工作。<br/><br/>　　一是认真遴选确定参赛项目。大赛的项目很多，我们选择适合我们的或者我们有优势的项目，或者需要提升的项目。我们组织了各行各业的专家，对50个比赛项目进行科学论证，最终确定了45个参赛项目。<br/><br/>　　二是精心组织全国选拔赛。选手参加“技能奥林匹克”，就要选拔最优秀的选手，让技能最优秀、心理素质最优秀、也最有展示经验的选手参加比赛。我们参照世界技能大赛的竞赛标准和规则，采取了分散与集中相结合的比赛形式，在北京、上海、广东等13个赛区组织了45个项目的全国选拔赛，共有1040名选手参加，388名选手入围全国集训。竞赛规模、参赛人数和竞技水平都是历年之最。<br/><br/>　　三是科学开展集训工作。我们遴选确定并公布了86个第44届世界技能大赛的中国集训基地和44名中国技术指导专家组长。目前第一阶段的选拔正在有序开展，集训工作稳步推进。<br/><br/>　　四是积极开展对外交流活动。参加世界“技能奥林匹克”，不能自己在这儿闷着头练，还得参加各种对外的交流。我部分别组织技术指导专家和选手参加俄罗斯全国技能大赛、东盟技能大赛和欧洲技能大赛，深入了解世界技能大赛的技术标准、竞赛规则和工作流程，学习国外世赛选手的选拔、训练、竞赛技术等方面的经验做法，因为中国参加这个世界性大赛时间还不长，才参加了三届，前几届的规模也不是很大，所以参赛经验还需要不断摸索借鉴。<br/><br/>　　目前，根据世界技能组织确定的比赛项目、实际工作情况，我们在45项确定的参赛项目基础上，又准备增加3D数字游戏艺术、货运代理和商品展示技术等3个参赛项目，这样总共就有48个参赛项目。但是世界技能竞赛组织有一项叫钣金项目，因为参赛国比较少就取消了，所以参赛项目有47个。<br/><br/>　　下一步重点，还有半年多的时间，重点就是组织好集训工作，这里面包括要科学确定选手的选拔工作方案，严格选手淘汰环节的程序管理，公平公正开展集训选拔，确保选拔出最优秀的选手代表国家参赛。今年6月份，我部还将在上海等地举办2017中国国际技能大赛，邀请国外专家和选手来华比赛。同时，我们也将组团赴芬兰、澳大利亚和我国香港等地区参加国际性赛事，尽可能为参赛选手和技术专家创造参赛条件，使参赛选手适应竞赛环境，使专家熟悉规程和标准，积累经验。另外我们还将邀请世界技能大赛一批外方专家来华对参赛备战工作进行技术指导。<br/><br/>　　总之，我们将在第43届世界技能大赛取得成绩的基础上，力争取得优异成绩。同时，今年还有个重要任务，我国将申办第46届世界技能大赛，我们正在会同有关方面紧张有序地开展申办工作，力争申办成功。<br/><br/>　　工人日报记者：<br/><br/>　　岁末年初是欠薪问题的多发时期。请问发言人，人社部保障农民工工资支付方面目前采取了哪些措施？能不能透露一下各地具体落实的情况？<br/><br/>　　卢爱红：<br/><br/>　　每到岁末年初，治理欠薪问题都是一项重要工作，党中央、国务院高度重视，社会各界非常关心。昨天我部邱小平副部长在人民网强国论坛上介绍了这方面的工作情况和下一步的打算。<br/><br/>　　去年初，国务院印发了关于全面治理拖欠农民工工资问题的意见，提出了一揽子、一系列的治标治本的解决农民工工资拖欠问题的措施。各地认真落实这个文件，我们认为取得了非常明显的成效。到去年底，各省区市政府普遍出台了相应实施意见，完善了工作协调机制。还有许多地区把解决农民工工资问题纳入政府考核评价范围和社会治安综合治理的考核内容，可见各地对治理拖欠农民工工资问题的高度重视。<br/><br/>　　通过这一年的工作，总的来看，各地预防和解决拖欠农民工工资问题的长效机制初步建立，属地管理的责任进一步落实。我这里有个数据，去年一年，通过日常的劳动保障监察等方式，共查处工资类违法案件23.3万件，同比下降了14.8%，共为372.2万名劳动者追发工资等待遇350.6亿元，涉及劳动者人数同比下降了22.7%，涉及的工资数额同比也下降了16.7%。<br/><br/>　　 一到岁末年初，这项工作又是一个重要的节点。这些年来，我部每到这个节点，都要会同相关部门，开展治理拖欠农民工工资问题的专项行动。今年也同样，而且声势很大，采取的措施更严厉，各地抓这项工作抓得更加扎实，目的是努力确保今年春节前拖欠农民工资问题得到有效解决，坚决遏制因欠薪引发影响社会稳定的重大事件。<br/><br/>　　这次专项行动主要做了这样一些工作：<br/><br/>　　一是在全国范围部署专项检查。我部会同部际联席会议成员单位，从去年11月中旬到今年春节前，在全国范围内组织开展专项检查，并且在这个过程中组成联合督查组，对部分重点地区开展工作督查，确保工作措施落实到位。<br/><br/>　　二是开展集中宣传。我们开展了依法保障农民工劳动报酬权益宣传活动，意在督促用人单位依法履行法定义务，引导农民工依法理性维权，形成良好氛围。同时，还特别注意，在专项检查期间，集中公布拒不支付劳动报酬犯罪的典型案例。大家知道，拒不支付劳动报酬罪是2011年列入刑法的一条罪状，是对拒不支付劳动报酬实施高压的一个措施，对恶意欠薪犯罪行为进行震慑。<br/><br/>　　三是积极查处欠薪案件。劳动保障监察行政执法系统都有对外公布的举报电话，我们进一步畅通举报投诉渠道，加大劳动保障监察执法力度，对所有欠薪隐患进行排查，并逐一登记备案，制定整改措施。对欠薪案件发现一起、查处一起，对采取非法手段讨薪或以讨要工资名义讨要工程款，扰乱社会治安秩序的，由公安机关依法查处。<br/><br/>　　我这儿有个开展专项活动的数据，目前取得的阶段性成果，从2016年11月15日至今年1月15日，各地已为76.65万农民工追讨欠薪92.04亿元。下一步，我们还将继续加大工作力度，切实保障农民工劳动报酬权益。<br/><br/>　　经济参考报记者：<br/><br/>　　国家职业资格目录清单将在上报国务院审定后对社会公布，请问这个目录下一步是否会有调整或者增补，人社部对这方面工作下一步会有什么样的计划和打算？<br/><br/>　　卢爱红：<br/><br/>　　这项工作是我部落实“放管服”改革、政府审批制度改革的一项重大改革措施，连续做了几年，是降低就业创业门槛、激发市场活力和社会创造力、促进创业创新的一项重大改革。2014年以来，我们已经先后7批取消了433项国务院部门设置的职业资格许可和认定事项，削减比例达到了原总量的70%以上。这项工作现在进入另一个阶段，就是在削减职业资格比例的基础上，怎么样改革深化和推进后续工作。其中一项重要改革就是我们研究提出了建立国家职业资格目录清单管理制度。去年12月份，我部将拟列入职业资格目录清单的151项国家职业资格向社会进行了公示，目前正在按程序系统梳理社会各界提出的意见。<br/><br/>　　下一步，我们将按程序报请审定以后，以我部的名义向社会公布这个职业资格目录清单，这里面包括职业能力、水平评价、职业资格准入等等方面，本身职业资格就是这个含义。目录清单之外，一律不得许可和认定职业资格。目录清单之内，除准入类职业资格外，一律不得与就业创业挂钩，这是下一步改革的一个基本思路。<br/><br/>　　还有，今后凡新设国家职业资格，须报人力资源和社会保障部纳入这个职业资格目录清单。同时我们对这个目录清单保持相对稳定，实施动态调整，还要接受社会监督。今年1月5日，我部又印发了进一步减少和规范职业资格许可和认定事项的改革方案，提出了下一步改革任务和工作措施。在集中做好清理职业资格许可和认定事项工作的同时，我们将从建立长效机制、完善政策体系、加强法治建设等方面，进一步完善我国职业资格制度，实现职业资格改革既“瘦身”又“健体”、既治标也治本的目标。<br/><br/>　　今天的发布会到此结束。春节马上就要到了，也祝新闻界的记者朋友们新春快乐，阖家幸福。谢谢大家！</span></p>', '', '', '', 0, 0, 1, '', 1485157173),
	(21, 6, '央行媒体：临时流动性便利缓解资金紧张 不代表政策转向', '', '<p><span style="font-size: 18px;">        1月20日下午，中国人民银行表示，为保障春节前现金投放的集中性需求，促进银行体系流动性和货币市场平稳运行，人民银行通过“临时流动性便利”这一新工具的操作，为在现金投放中占比高的几家大型商业银行提供了临时流动性支持，操作期限28天，资金成本与同期限公开市场操作利率大致相同。<br/><br/>　　有市场人士称此次临时流动性便利操作为“定时定向降准”。对此交通银行首席经济学家连平表示，此次操作不是降准，不代表货币政策转向。此次流动性便利操作仍需要银行付息；而准备金是银行自有资金，无需付息。该流动性便利在到期后要归还，属于再贷款性质；而降准后除非再次提高准备金率，没有归还的问题。因此，该流动性便利操作更多属于公开市场投放流动性的工具，与准备金率调整完全不同，不可混淆。<br/><br/>　　缓解银行间市场流动性紧张<br/><br/>　　随着外汇占款持续减少、金融机构准备金上缴、缴税、春节前企业和居民流动性需求上升，央行虽通过公开市场操作在上周(1月16日至22日)净投放6350亿元，对冲MLF到期2165亿元，仍然不能缓解银行资金面持续偏紧的局面。<br/><br/>　　上周，市场利率水平明显上升。上海银行间同业拆放利率(Shibor)20日再度全线上涨，已连续普涨6个交易日。其中，隔夜Shibor报2.3760%，上涨1.20个BP；7天Shibor报2.5930%，上涨5.50个BP；3个月Shibor报3.8213%，上涨1.83个BP.<br/><br/>　　就此连平表示，尽管央行连续在公开市场进行资金投放，但资金紧张的压力不减。在此情况下，仅凭各类公开市场操作工具似乎不足以缓解市场紧张形势，因而临时流动性便利操作适时出台。<br/><br/>　　面对外汇占款的下滑，央行通过公开市场、创新借贷便利工具等多种方式向商业银行补充资金，这已逐渐成为央行供应基础货币的主要方式。招商证券宏观分析师闫玲预计，本次释放流动性约6500亿元，期限28天，暂时降低大行短期银行资金成本。本次临时流动性便利操作虽然无抵押物，但是仍有成本，与同期的公开市场操作一致，为2.55%，低于中期借贷便利(MLF)的成本(3.0%).<br/><br/>　　连平表示，与现有的1个月期MLF和28天期逆回购操作相比，该流动性便利操作不需要质押债券，这一关键区别是该操作能够直接、显著缓解近期市场流动性紧张的主要原因。因为持续通过大规模的质押债券来向央行换取资金，会导致银行优质流动性资产减少，影响银行流动性覆盖率指标达标。可以预期，这一临时流动性支持将明显缓解市场紧张，促进市场流动性平稳。<br/><br/>　　货币政策依然保持稳健中性<br/><br/>　　“这一操作进一步证明，准备金率不会轻易下调，央行仍倾向于运用短期、灵活工具来调节短期流动性。”连平表示，降准有可能对人民币贬值带来进一步的刺激，目前并不合适。而且2016年以来信贷增速并不低，全年新增12.65万亿元，加上地方政府债务置换则更多，降准会进一步刺激信贷增长，不利于降杠杆。现阶段货币政策仍保持稳健中性，更加注重防风险和去杠杆。<br/><br/>　　闫玲也认为，人民币汇率仍存贬值预期，2017年通胀仍有上行预期，美联储加息等因素对国内货币政策的掣肘依然存在。<br/><br/>　　来自中金公司的分析认为，春节取现、企业缴税、外汇占款流出、缴纳法定存款准备金四个因素同时叠加，保守估计回笼2-3万亿元流动性，会导致银行出现较大流动性缺口。如果央行只是依靠MLF和逆回购投放流动性，因为期限较短，效果会较差，而且目前总量投放也不足。闫玲还表示，从金融去杠杆的角度来看，银行的资产负债表和同业业务的调整尚未完成，且表外理财纳入广义信贷考核等监管政策都可能影响流动性。<br/><br/>　　央行称，临时流动性便利这一操作可通过市场机制更有效地实现流动性的传导。<br/><br/>　　据机构测算，春节前将有总计6575亿元资金到期，包括4400亿元7天逆回购、200亿元28天逆回购、1175亿元1年期MLF和800亿元3个月国库定存。而春节后至2月底，总计将有16950亿元流动性到期，包括500亿元14天逆回购到期、14400亿元28天逆回购到期、2050亿元1年期MLF。考虑到节后资金回笼，流动性偏紧压力仍需关注。</span></p>', '', '', '', 0, 0, 1, '', 1485157276),
	(22, 6, '总理三次座谈会传递哪些重要信号：减税降费 振兴实体经济', '座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号座谈会传递哪些重要信号', '<p style="line-height: 2em;"><span style="font-size: 18px;">近期，李克强总理主持召开了三场座谈会和一次国务院全体会议，听取大家对《政府工作报告(征求意见稿)》的意见、建议。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">记者梳理这些会议披露的信息发现，减税降费、继续实施创新驱动发展战略、振兴实体经济、促进民间投资等内容有望成为今年政府工作报告的要点。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">信号一：减税降费</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">1月13日，总理主持召开座谈会听取专家学者和企业界人士对《政府工作报告(征求意见稿)》的意见、建议。在此次会议上，“企业税费负担”是大家谈论的焦点。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">李克强在会上明确表态：今年要在降低收费等非税负担方面让企业有切身感受，国务院要对此开展督查。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">从与会学者的发言中也可窥见政府工作报告中相关内容要点。中国社科院学部委员、经济研究所所长高培勇表示：“我非常赞同报告中的一段内容，就是政府将继续推动减税降费，但减税的来源不是增加赤字，而是同步降低企业税负和政府支出。”</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">如何降低企业税负？李克强指出，需要继续深化“放管服”改革，抓紧制定实施和逐步完善权力清单、责任清单，切实降低制度性交易成本。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">如何降低政府支出？李克强要求，要进一步压缩一般性公共支出，提高支出效率。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">信号二：继续实施创新驱动发展战略</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">1月16日，李克强主持召开座谈会，听取教育、科技、文化、卫生、体育界人士和基层群众代表对《政府工作报告(征求意见稿)》的意见建议。李克强在会上强调，要继续实施创新驱动发展战略。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">自党的十八大明确提出实施创新驱动发展战略以来，最近几年的政府工作报告中都会将这一点写入其中，并且提出诸多具体落实政策。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">总理在发言中提到接下来将要采取的政策：要落实扩大高校和科研院所教学科研自主权的政策措施，加大政策和资金支持，鼓励从事基础研究的科研人员沉下心来搞研究，把冷板凳坐热；抓紧研究提高研究生基础补贴标准，调动青年人才积极性。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">值得注意的是，在这几次座谈会上，多位被总理邀请的嘉宾都提到了与科技创新有关的内容。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">在1月13日召开的座谈会上，TCL集团李东生建议，要加大对战略性新兴产业和重要基础核心技术开发的扶持。摩拜单车公司胡玮炜则表示，要鼓励和支持科技创新，促进分享经济等新业态发展。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">在16日召开的座谈会上，清华大学副校长施一公院士建议，要重视科技人才培养和引进工作，建立长期稳定支持优秀科学家的机制。在1月19日召开的座谈会上，无党派人士代表李卫就提高自主创新能力、发展人工智能谈了看法。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">信号三：振兴实体经济</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">1月19日，李克强主持召开座谈会，听取各民主党派中央、全国工商联负责人和无党派人士代表对《政府工作报告(征求意见稿)》的意见建议。与会代表就多个问题发表了看法，关键词主要涉及“一带一路”建设、海绵城市建设、农业面源污染治理、振兴实体经济、促进民间投资等。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">值得注意的是，着力振兴实体经济有望成为今年政府工作报告中重要内容。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;"><br/></span></p><p style="line-height: 2em;"><span style="font-size: 18px;">在1月13日召开的座谈会上，李克强指出，以新技术新模式推动传统产业改造提升，加快发展先进制造业，促进包括一二三产业在内的实体经济升级，提高需求的有效性。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">1月18日，李克强主持召开国务院第六次全体会议，讨论拟提请十二届全国人大五次会议审议的政府工作报告。李克强在会上表示，今年要推动实体经济升级和民生不断改善。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">从今年地方政府工作报告来看，各地振兴实体经济的政策主要集中在促进传统产业转型升级和培育壮大新兴产业方面。</span></p><p style="line-height: 2em;"><span style="font-size: 18px;">比如，吉林在部署今年经济工作时首要强调的就是更加注重实体经济发展。政策重点是发展智能制造等新产业，改造提升、巩固壮大汽车、石化、农产品加工等传统支柱产业。天津也提出，着力推进产业转型升级和大力发展实体经济。政策涉及大力发展先进制造业，设立战略性新兴产业发展基金，开展“互联网+”产业集群行动，推进传统产业实施技术改造、智能改造、绿色改造等。</span></p><p><br/></p>', 'upload/20170615/1497518370.png', '', '', 0, 0, 1, '', 1485237446),
	(23, 1, '外汇局：外商投资企业正常利润汇出不受限制', '', '<p style="line-height: 2em;"><span style="font-size: 18px;">2017年1月23日，中国人民银行副行长、国家外汇管理局局长潘功胜在北京会见了中国欧盟商会主席伍德克先生一行。双方就当前中国经济发展前景、跨境资金流动和外汇管理政策等问题进行了沟通交流。</span></p><p><br/></p><p style="line-height: 2em;"><span style="font-size: 18px;">潘局长指出，中国经济保持平稳健康发展，2016年GDP同比增长6.7%，仍处于世界前列，支持国际收支平衡的根本性因素依然长期存在。中国致力于营造宽松有序的投资环境，让中国市场更加透明规范。</span></p><p><br/></p><p style="line-height: 2em;"><span style="font-size: 18px;">外汇管理部门将保持外汇管理政策连续性、一贯性，切实提升贸易投资便利化水平，外商投资企业正常利润汇出不受限制，支持有能力、有条件的企业开展真实合规的对外直接投资。同时，加强真实性合规性审核，着力防范跨境资本流动风险，维护外汇市场健康稳定。</span></p><p><br/></p>', '', '', '', 0, 0, 1, '', 1485237945),
	(24, 1, '专家：中国对TPP持开放态度 坚定推进贸易自由化', '', '<p style="line-height: 2em;"><span style="font-size: 18px;">据外媒报道，在美国总统特朗普签署命令退出跨太平洋伙伴关系协定(TPP)后，澳大利亚贸易与投资部长Steven Ciobo周二表示，中国和印尼可以加入该协定，以填补美国留下的真空。中国国际问题研究院研究员杨希雨接受记者采访时表示，中国对TPP持开放态度，不论澳大利亚方面的态度如何，中国依旧会坚定不移地推进贸易投资自由化与便利化。</span></p><p><br/></p><p style="line-height: 2em;"><span style="font-size: 18px;">杨希雨认为，澳大利亚的表态主要还是为本国利益考虑。自上世界90年代，澳大利亚一直在努力融入亚太经济，TPP对它来说是最好的桥梁。在奥巴马执政时期，澳大利亚就对TPP十分积极。美国的退出令TPP的经济总额大大缩水，意义和影响也大大下降，这是澳大利亚不愿意看到的。</span></p><p><br/></p><p style="line-height: 2em;"><span style="font-size: 18px;">“而中国对于TPP的态度非常淡定，对其持开放态度，另一方面也不强求，这是因为中国有战略自信。要追寻区域贸易自由化，TPP不是唯一的道路。”杨希雨表示，在态度上中国坚定不移的参与与支持区域贸易自由化，在路径上积极的推进区域全面经济伙伴关系协定(RCEP)、东盟10+1、中日韩自贸协定谈判等。也就是说，从次区域到区域再到跨区域的贸易自由化，中国拥有多个平台与路径。因此，无论澳大利亚的态度如何，中国还是会按照自身的意愿来继续推进贸易投资自由化进程。</span></p><p><br/></p>', '', '', '', 0, 0, 1, '', 1485238349),
	(25, 1, '调查：逾4成网友喜欢饮用白酒 机构多看好白酒行业', '', '<p><span style="font-size: 18px;">春节期间亲友聚会用餐是少不了的项目。饭桌之上也必然觥筹交错。在大家的推杯换盏之间，GDP也在蹭蹭的往上涨。春节期间大家在“酒逢知己千杯少”的同时有没有可以把握的投资机会呢？</span></p><p><br/></p><p><span style="font-size: 18px;">截至1月24日，共有9793位网友参与此次调查。首先我们就大家的饮酒习惯进行了调查。调查结果显示，有43.3%的网友表示喜欢饮用白酒。22.7%的网友表示偏好红酒，位列第二，喜爱啤酒和黄酒的网友的比例分别为15.4%和7.3%。</span></p><p><br/></p><p><span style="font-size: 18px;">以上调查结果显示，大多数中国人依然喜欢传统的白酒，似乎只有喝白酒更有中国人过年特有的氛围。随着对外交往的日益加深，西方的生活方式也慢慢地渗透到生活的各个领域，红酒也被越来越多的国人接受，中国与多数国家签订自贸协定以及各地自贸区的设立使红酒的进口价格有明显的下降，红酒的饮用也逐步平民化。</span></p><p><br/></p><p><span style="font-size: 18px;">2016年1-11月，葡萄酒总产量99.60万千升，同比下降2.00%，2016年1-10月葡萄酒进口量52.81万千升，同比增长14.85%，其中16年10月进口葡萄酒4.32万千升，同比增长27.98%。</span></p><p><br/></p><p><span style="font-size: 18px;">葡萄酒作为全球酒精类第二大消费板块，随着西式文化的渗透与主力消费阶层的更迭，葡萄酒在国内消费群体中的接受度显著提升。但从消费量来看，国内人均葡萄酒消费量仅为世界平均水平的三分之一左右，从这点来看国内葡萄酒仍然具备很大的发展空间。近两年的产量和进口数据也支持了国内葡萄酒消费处于恢复性增长的良性环境中。但由于葡萄酒文化是舶来产品，国内消费者对葡萄酒品牌认知尚浅，处于混乱和启蒙状态。国内部分葡萄酒龙头企业也在积极推进海外酒庄并购，推动国外酒庄产品在国内的品牌建立，传播葡萄酒文化，培养国内消费者的品牌忠诚度。</span></p><p><br/></p><p><span style="font-size: 18px;">白酒作为国内酒文化不可或缺的主要组成部分，在政务消费端口被限制之后，商务性消费以及个人消费成为新的主力，将很好的承接政务消费限制挤出的高端白酒需求。未来高端及次高端白酒仍有望受益于中产阶级崛起以及消费升级所带来的增量收益。目前茅台、泸州老窖对旗下中高端产品采取的控量措施已经令产品处于供不应求的状态，高端白酒整提价基础已经打好，建议关注贵州茅台、五粮液、泸州老窖。</span></p><p><br/></p><p><span style="font-size: 18px;">多家结构看好白酒板块，那2017年高端白酒价格会上涨吗？普通大众是否还有能力偶尔喝上一点高端白酒呢？我们的网络调查结果显示有47.5%的网友认为17年高端白酒的价格会上涨，36%的网友认为高端白酒不会涨价。，16.5%的网友认为不好说。</span></p><p><br/></p><p><span style="font-size: 18px;">2017 年开始高端白酒将进入加库存周期。下半年开始批价快速上涨使得目前渠道毛利空间超 40%，经销商盈利状况大为改善，赚钱效应显现；目前时点渠道普遍缺货，涨价预期和赚钱效应下经销商补库存动力强劲。加库存周期下茅台作为投资品的属性显现，极有可能出现涨价预期-补库存-批价上涨-加大囤货的循环中。目前市场对于批价上涨的一致预期已经形成，一旦进入补库存周期茅台将大概率提价缩小渠道价差，保守预计提价 10%，18 年业绩增速将达到30%以上，再现09-12年补库存周期中业绩高速增长的辉煌。</span></p><p><br/></p><p><span style="font-size: 18px;">通过以上的总结，希望您在春节畅饮美酒的同时能遭到自己中意的投资标的，节后迎来开门红。最后提醒一下：为了您和家人的安全，春节期间，喝酒不开车，开车不喝酒。</span></p><p><br/></p>', '', '', '', 0, 0, 1, '', 1485324877),
	(26, 1, '成都出台限地令：土地溢价率在60%及以上3个月缴全款', '', '<p>为了全面贯彻执行国家房地产市场调控政策，完善成都市经营性建设用地供应调控机制，促进土地市场平稳健康发展。近日，成都市人民政府办公厅印发了关于《完善经营性建设用地土地调控机制促进我市土地市场平稳健康发展的通知》。</p><p><br/></p><p>一、编制供应计划，调控经营性建设用地供应总量</p><p><br/></p><p>每年2月15日前，各区(市)县政府(合成都高新区、成都天府新区管委会，下同)根据本辖区可供经营性建设用地、已供经营性建设用地开发利用以及土地市场等情况，编制年度经菅性建设用地供应计划草案报市国土局，由市国土局会同市房管局根据各地前五年经营性建设用地平均供地量、上一年经营性建设用地实际供应量、可售商品住房销售周期、商业办公用房库存量等指标，统筹平衡全市经营性建设用地供应计划，并于当年2月底前报市政府批准后下达执行。</p><p><br/></p><p>二、建立信息系统，动态监测经营性建设用地利用情况</p><p><br/></p><p>由市国土局牵头会同市规划局、市建委、市房管局建立成都市国有建设用地动态监管系统(以下简称：动态监管系统)，集合土地现状、土地规划、城乡规划、用地报征、征后实施以及经营性建设用地的土地供应、规划许可、施工许可、房屋预售、备案登记、地价和房价变化等信息，对国有建设用地开发利用情况进行全过程、多层次动态监测。为科学预判房地产市场形势、调控土地供应总量、把握土地上市节奏、实施精准式供地提供决策依据。</p><p><br/></p><p>三、实施统筹管理，科学精准调控经营性建设用地供应</p><p><br/></p><p>经营性建设用地按照供应计划指导与实时监测控制相结合的方式进行管理。在市政府下达的经营性建设用地供应计划控制指标范国内，各区(市)县政府应统筹安排本辖区的经营性建设用地供应，合理确定县城、重点镇、重点产业发展区的供地规模和用地结构，加大重点支持区域土地供应力度。按照动态监管系统的实时监测结果，对可售商品住房销售周期低于下限的区域，可向市政府申请调增本区域年度经营性建设用地供应计划，适时增加供地规模，适度加快供地节奏，有效管控土地价格，确保适应经济社会发展水平的居住用地需求；对可售商品住房销售周期高于上限或者商业办公用房库存量超过市房管局确定的控制指标的区域，暂停经营性建设用地供应。</p><p><br/></p><p>成都市五城区土地出让方案决策委员会对全市经营性建设用地供应计划实施统筹管理。因重大产业化项目用地、房地产市场变化等因素需调整经营性建设用地供应计划的，各区(市)县政府可向成都市五城区土地出让方案决策委员会提出申请。</p><p><br/></p><p>四、采取有效措施，促进土地供应科学合理</p><p><br/></p><p>1、合理确定土地出让起始(叫)价</p><p><br/></p><p>密切跟踪市场变化情况，认真研究房地产市场价格与税费负担、建安成本、财务费用、合理利润的关系，积极预判市场价格水平，科学确定出让起始(叫)价，避免出现“地王”和“过高溢价率”。</p><p><br/></p><p>2、调整拟上市宗地竞买保证金缴纳比例</p><p><br/></p><p>对热点区域(包括中心城区、龙泉驿区、双流区)内的商品住宅及含商品住宅的经营性用地，相应调整竞买保证金缴纳比例。</p><p><br/></p><p>3、限制单宗商品住宅用地供应规模</p><p><br/></p><p>中心城区不得超过300亩。龙泉驿区、青白江区、新都区、温江区、双流区、郫都区不得超过210亩，简阳市、都江堰市、彭州市、邛崃市、崇州市、金堂县、大邑县、蒲江县、新津县不得超过105亩。</p><p><br/></p><p>4、缩短土地出让价款缴纳期限</p><p><br/></p><p>对上市出让宗地成交溢价率在60%及以上的，要从《国有建设用地使用权出让合同》签订之日起3个月内缴清全部土地出让价款。</p><p><br/></p><p>五、加强协调配合，确保经营性建设用地供应调控效果</p><p><br/></p><p>各区(市)县政府、市政府有关部门、有关单位要密切配合协作，落实工作责任，确保经营性建设用地供应调控取得良好效果。</p><p><br/></p>', '', '', '', 0, 0, 1, '', 1485325004),
	(27, 1, '国务院发布发展规划 民族地区企业上市融资获政策支持', '', '<p>中国政府网1月24日消息，国务院近日发布《“十三五”促进民族地区和人口较少民族发展规划》(简称《规划》)。《规划》提出财政政策、投资政策、金融政策九大政策支持措施，并表示积极支持民族地区符合条件的企业在沪深交易所上市或在“新三板”挂牌并融资，支持符合条件的民族地区上市、挂牌公司通过并购重组做优做强，促进民族地区上市、挂牌公司健康发展。</p><p><br/></p><p>《规划》指出，充分发挥政策性金融、开发性金融、商业性金融和合作性金融作用，加大银行业、证券业、保险业对民族地区支持力度，重点支持基础设施、特色优势产业、能源、环保、教育、文化、医疗卫生等领域建设。加大民族地区信贷投入力度，鼓励民族地区县域内银行业金融机构新吸收存款一定比例用于当地发放贷款，重点支持中小企业、民贸民品企业发展。鼓励符合条件的金融机构在民族地区设立分支机构，加大金融服务力度，努力消除基础金融服务空白乡镇。推动符合条件的民间资本在民族地区依法发起设立民营银行和消费金融公司，参与发起设立村镇银行。规范民族地区信托业发展，支持融资担保机构从事中小企业担保业务。</p><p><br/></p><p>《规划》表示，积极支持民族地区符合条件的企业在沪深交易所上市或在“新三板”挂牌并融资，支持符合条件的民族地区上市、挂牌公司通过并购重组做优做强，促进民族地区上市、挂牌公司健康发展。继续暂免征收西藏、新疆、内蒙古、宁夏、广西等自治区“新三板”挂牌公司的挂牌费用，实行专人对接、专人审核制度，做到即报即审、即审即挂。支持民族地区企业通过发行公司债、企业债、非金融企业债务融资工具和资产支持证券等方式进行融资。利用私募基金、产业基金、区域性股权市场和期货市场，支持民族地区经济发展。积极培育民族地区保险市场，不断丰富保险产品，拓宽保险服务领域。推动民族地区开展巨灾保险试点并推广，支持开展农业保险、贷款保证保险等业务。完善信贷风险补偿机制。</p><p><br/></p><p>《规划》表示，充分考虑少数民族和民族地区贫困人口、交通状况、气候条件、生态环境等方面的公共支出成本差异，加大中央财政投入力度，完善财政一般性转移支付增长机制，一般性转移支付资金和相关专项转移支付资金进一步向民族地区倾斜，确保对民族地区转移支付在总盘子中的比重继续增加。建立健全各级支持少数民族发展的投入长效机制，通过现有资金渠道，重点支持贫困民族地区脱贫攻坚、少数民族事业、兴边富民行动、扶持人口较少民族发展等领域建设。充分兼顾民族地区利益，支持民族地区全面开展营改增试点。</p><p><br/></p>', '', '', '', 0, 0, 1, '', 1485325415),
	(28, 1, '六大投资总监透底鸡年秘笈 上半年国企混改军工板块好淘金', '随着2016年画上句号，越来越多的投资者开始聚焦于2017年资本市场走向，以及哪些板块机会更大。', '　　2017年景气度相对较高的成长型行业，经过大幅调整后估值处于较低的位置，此时估值具有吸引力，恰逢比较好的配置时期。<br/><br/>　　随着2016年画上句号，越来越多的投资者开始聚焦于2017年资本市场走向，以及哪些板块机会更大。多位基金公司投资总监表示，从股市、板块机会两个层面对鸡年的A股市场机会进行综合梳理，为投资者提供有价值的参考。<br/><br/><strong>　　行情：指数呈慢牛，结构性机会为主</strong><br/><br/>　　我们认为，2017年市场仍然是结构性投资机会。做出判断的两个条件为：首先，货币政策相对来说更紧一些，宏观经济稳增长的压力更大。2017年面临地产调控之后，其影响在上半年会显现出来，从而使得整个经济稳增长难度加大。其次，2016年末市场呈现的是结构性机会，市场指数向下和向上的动力不会太强，而2017年指数会走出一波慢牛行情，不过，获得超额收益和绝对收益的公司和行业不会很多。国泰基金事业部负责人杨飞如是判断。<br/><br/>　　华商基金投资管理部副总经理李双全也持同样的看法。对2017年大盘的走势判断，A股可能还是以结构性行情为主。李双全告诉《投资者报》记者，“随着中央经济工作会议定调‘稳健中性’的货币政策，我们对于2017年市场流动性不能做过于乐观的预期。从估值的角度看，难以看到较大的提升空间，赚业绩增长的钱可能是更现实的选择。”<br/><br/>　　博时基金股票投资部总经理李权胜也指出，受到全球格局的潜在变化、国内经济的发展趋势等宏观环境、居民资产配置方向的转变、以及机构投资者的崛起等微观因素，将使得A股市场进入到一个“新常态”的阶段。在实际投资过程中，我们需要从大到国家经济转型、小到细分产业变迁中进行深度的分析研究；以产业的眼光要求来进行股票的基本面投资，以“新价值、新投资”的策略去积极应对市场的变化。<br/><br/>　　“我们对2017年股票市场的看法积极，通过研究产业空间、分析上市公司竞争力，就可以发现优质的投资标的。”鹏华基金副总裁高阳同样认为，目前A股市场整体估值相对合理，但2017年出现系统性机会的可能性仍小。<br/><br/>　　“我是看震荡慢牛的，除非通胀失控。当前，经济企稳和企业盈利恢复的基本面改善趋势暂时没有拐头迹象，对权益市场偏利好，但无风险利率上升过快将削弱‘资产荒’逻辑，不利于权益市场。综合来看，A股将维持震荡走势，预计中枢很可能是向上的，毕竟，无风险利率的上升是决策层主动管控风险去杠杆纠正过度期限错配导致的，适当时候会有所修正，且决策层有控制能力，而国债持续暴跌不符合稳中求进的工作方针。当然，还是不要过度乐观，指望大牛市轻松挣钱的可能是非常不现实的。去年的大牛市和随后的三轮快速大幅下跌给出了深刻的经验和教训，决策层很难再支持超脱基本面的大牛市。前几年我就指出过，上市公司ROE10%左右，如果股市每年上涨10%是较合理的，既不透支，也不滞后。”南方基金总裁助理、权益类首席投资官史博如是说。<br/><br/><strong>　　板块：上半年看国企混改、军工，下半年看成长股</strong><br/><br/>　　既然2017年更多的是结构性机会，那么，哪些板块机会多些呢？对于这个问题，几位投资总监也直言不讳。<br/><br/>　　“基于宏观经济与策略的角度，2017年景气度相对较高的成长性行业，经过大幅调整后估值处于较低的位置，此时估值具有吸引力，恰逢比较好的配置时期。因此2017年上半年可能更多会从稳增长、财政政策发力的角度去挑选我们所需要的行业，如园林环保行业；下半年创新性行业的估值可能很有吸引力，包括计算机、传媒等行业都会有很好的投资机会。另外，如消费电子、医药生物等稳增长行业一年都具有较好的投资机会。”杨飞如是说。<br/><br/>　　“2017年我较为关注两方面投资机会，第一是蓝筹股。一方面以险资为代表的金融资本配置蓝筹股的趋势不会改变。要覆盖负债端的成本，险资这类长期资金增加权益类配置的趋势没有根本改变，当前的监管只是延长和规范这一过程。另一方面随着沪深港通的推进，A股与海外股票市场接轨越来越紧密，估值体系也将相互影响。无论是对于险资，还是海外资金，稳健型的蓝筹股都具有稀缺性。另一个机会就是家电、汽车和面板等行业的‘龙头股’。这些行业已经形成寡头格局，根据行业发展规律，其龙头公司的市场份额有望进一步提升，盈利能力持续向上，且成功的概率较大。相比之下，‘黑马型’成长股的投资不确定性相对较大，需要仔细甄别。创业板估值消化了一年，整体估值依然不便宜。2017年在整体估值不便宜的基础上，再加上流动性预期不会太乐观，创业板整体估值向上的空间可能并不大。因此，投资创业板需要自下而上挑选真正的优质成长股，能够通过业绩增长消化估值。”李双全表示，除了上述两大机会之外，还关注军工、国企改革等领域。预计，未来军工行业事件性驱动因素有所增加，军民融合战略作为这一轮中国转型的核心，发展的路径会越来越清晰。<br/><br/>　　“看好经济企稳、息差扩大利好的银行业；利率回升减轻配置压力和万能险监管改善竞争格局的保险业；基本面触底，CPI推动营收，且价值有重估潜力的商贸零售；服务业占GDP的比例提升市场预期极低的传媒行业，以及部分盈利能够恢复的中游制造业。主题上关注国企改革、农业‘供给侧改革’和中美摩擦增多利好的国防军工。”史博说。<br/><br/>　　“2017年市场可能会更多体现出结构性机会。总体上，全年看成长股的机会应该更大，但是周期股和价值股也会有个体性的、分散的投资机会。很多成长股经过一年多的调整，到今年一季度二季度之交，调整时间已有两年。而随着不少成长股业绩的增长，它的估值相对更有吸引力，而且确定性会更高。如此，成长股整体的估值中枢基本可以稳定下来，也有利于基本面分化，经典的成长股可能会重新成为市场追逐的对象。整体来看，相较于周期股和价值股，成长股的机会可能是批量性的。因此，2017年A股市场可能会比较活跃，主题性投资机会增多。”广发基金投资总监刘晓龙如是说。', '', '', '', 0, 0, 1, '', 1486086238),
	(29, 1, '五利好PK三压力 两主线紧抓鸡年新机会', '伴随着上证指数定格在3159.17点，猴年股市收官。今日将迎来鸡年的首个交易日，假期中多空因素的影响力将集中兑现，A股能否迎来“开门红”，续演春节的“红包”行情，无疑成为各方讨论的焦点。', '<span style="font-size: 14px;">　<span style="font-size: 14px; color: rgb(192, 80, 77);">　分析人士表示，2017年股票市场将更具吸引力，加上保险资金、养老金等增量资金入市，市场整体向好</span></span><br/><br/>　　伴随着上证指数定格在3159.17点，猴年股市收官。今日将迎来鸡年的首个交易日，假期中多空因素的影响力将集中兑现，A股能否迎来“开门红”，续演春节的“红包”行情，无疑成为各方讨论的焦点。<br/><br/>　　多家机构认为，在诸多不确定性前提下，市场仍以结构性机会为主，不确定性多，主题也多，整体机会多于2016年。有分析人士表示，2017年股票市场将更具吸引力，加上保险资金、养老金等增量资金入市，市场整体向好，虽然难有大牛，但对鸡年行情持谨慎乐观看法，预计将震荡上行，底部抬升。<br/><br/><strong>　　三大因素冲击A股市场</strong><br/><br/>　　在我国欢度春节期间，世界金融市场并不平静，多空因素相互交织，资本市场再度风起云涌。<br/><br/>　　有分析认为，当前国内股市面临三大冲击。<br/><br/>　　首先，受特朗普移民禁令影响，全球股市上演连环跌。当地时间1月30日美国三大股指收盘时创2017年最大单日跌幅，同时欧股收跌逾1%，创两个月最大单日跌幅。另外，港股农历新年后首个交易日收阴。<br/><br/>　　其次，2月份A股将迎来年内首个解禁高峰。数据显示，2月份解禁股数量达到205亿股，参考市值约为2913.1亿元。其中，首发原始股东解禁压力巨大，解禁规模达到131.9亿股，参考市值超过2000亿元。<br/><br/>　　第三，截至1月25日，沪深两市融资余额十二连降，或对后市行情构成冲击。<br/><br/>　<strong>　五利好提振市场信心</strong><br/><br/>　　面临诸多不利因素，A股市场能否独善其身呢？历史数据显示，过去15年(2002年-2016年)，春节前后A股大概率上涨，春节后5个交易日，上涨概率80%，平均涨幅1.6%。光大证券表示，无论从历史规律上，还是流动性、企业盈利以及政策面上来看，春季(2月份-3月份)是市场环境比较温和的一个时间窗口。综合分析来看，春节前后市场明显上涨的主要原因有五方面。<br/><br/>　　其一，国家统计局、中国物流与采购联合会1日联合发布数据，2017年1月份，中国制造业采购经理指数(PMI)为51.3%，比上月微落0.1个百分点，连续6个月站上50%的荣枯线，延续平稳扩张态势。<br/><br/>　　其二，一季度是信贷高峰，流动性相对宽裕。元旦后、春节后流动性都会出现明显缓解。<br/><br/>　　其三，年底至春节前后由于公司发奖金、年底结账等因素，居民可支配资金提升，配置各类资产的需求均提升。<br/><br/>　　其四，全国两会即将召开，市场普遍对于两会有正面预期，也能够有效提高市场风险偏好。<br/><br/>　　其五，未来随着首批基本养老基金投资运营模式的成熟，养老金的归集以及投资运营资金有望逐步到位。分析人士预计未来几年养老金将为A股带来3000亿元至6000亿元的增量资金。<br/><br/>　　总之，外围市场下跌对A股影响不大，因为A股市场是一个相对封闭的市场。前海开源基金杨德龙表示，美股过去5年都是大牛市，而A股则比较低迷，目前还趴在地板上，外围市场下跌对A股“开门红”有一定的影响，更多的是在情绪上，而且只是短期的影响，而A股在节前就已经开始走稳了，节后养老金也将入市，加上“两会”即将召开，可能会有一定的政策利好出台，或将助推A股的春季攻势。<br/><br/>　　从投资策略来看，可从两条主线把握投资机会。分析人士表示，2017年的股票市场会越来越多地受到实体经济的影响，一方面需要关注顺周期且盈利大幅增长的相关行业，供给侧改革和环保限产使得部分产品价格波动幅度较大；另一方面可以关注稳定成长的领域，这里既包括受益于需求升级的消费品企业，也包括新兴行业中市场份额不断扩大的龙头企业。<br/><p><br/></p><br/>', '', '', '', 0, 0, 1, '', 1486086413),
	(30, 1, '害怕特朗普打贸易战？安倍掏养老金送“大礼”', '日本政府正准备掏出本国人民的养老金，投资美国基建项目，为美国创造就业。', '　　近日，财经博客ZeroHedge援引多家外媒报道，称日本政府正准备掏出本国人民的养老金，投资美国基建项目，为美国创造就业。这也是2月10日日美峰会前，日本献出的极具诚意的“大礼”。<br/><br/>　　在过去数年里，作为全球最大的养老金，日本政府养老金投资基金(Government Pension Investment Fund，，GPIF)一直在不断增加其风险敞口，包括投资高风险股票和高息债券，这种压赌增大了股市季度波动的幅度，更别说巨大的经济下行风险会让全球股市陷入崩盘的处境中。接下来，GPIF决定再次出手，投资美国基础设施项目。<br/><br/>　　《日经新闻》撰文报道称，日本和美国领导人将在下周(2月10日)于华盛顿召开峰会，双方届时的讨论会涉及一揽子经济合作项目，日本GPIF对美国基础设施项目的投资则将主要围绕在这些项目上。与美国总统唐纳德·特朗普的议程保持一致，既定的目标是创造“成千上万的美国就业机会”，并深化两国之间的关系。<br/><br/>　　背后的目的则是为了避免特朗普猛烈抨击日本将其列为汇率操纵国，并尝试“曲线控制”日本危险的QQE政策，而这是所有安倍经济学的基石。<br/><br/>　　特朗普曾公开将言论指向墨西哥、中国和德国，日本担心自己可能会成为特朗普下一个炮轰的对象。特朗普曾在近日会见制药公司的首席执行官们暗示称：“在与美国竞争时，其他国家通过货币贬值的手段获得不正当优势。”<br/><br/>　　随后，特朗普直接点名“中国和日本”为计划经济下的货币市场。<br/><br/>　　因此，日本首相可能只是想单纯的通过养老金向美国基础设施投资数十亿美元，将其作为安抚特朗普的一种手段，从而避免更可怕的后果，即特朗普可能会发动对日本的货币战或贸易战争。无论日本首相安倍思考的逻辑是什么，日本新的内阁级会谈对贸易政策和经济合作协议的讨论也摆上了日程。<br/><br/>　　《日经新闻》撰文报道称，日本赴美国参加华盛顿峰会的代表团队伍可能包括财政部长麻生太郎、经济部长Hiroshige Seko和外交部长Fumio Kishida。美国可能会派出商务部长Wilbur Ross、贸易代表Robert Lighthizer参会。日本首相安倍晋三和美国总统特朗普将在2月10日的会议上达成框架协议。<br/><br/>　　安倍晋三在周三向日本下院的委员们表示：“我希望就[日本]对提高美国整个工业部门的生产率和竞争力所做的贡献或大框架展开讨论，包括日本对美国基础设施发展带来的帮助。”日本政府已经开始着手就刺激就业增长而出台综合性的规划。<br/><br/>　　草案将以日本对美国基础设施投资、由双方共同研发的机器人和人工智能以及应对网络攻击等为主要内容。<br/><br/>　　那么日本庞大的养老基金将如何分配资本呢？《日经新闻》撰文报道称，GPIF将买入债券——通过日本退休人员的养老金购买——这些债券是由美国企业发行的，旨在为基础设施项目融资。在日本养老金控制的近130万亿日元(约合1.14万亿美元)资产中，最高可将5%用于购买海外的基础设施项目。<br/><br/>　　目前，日本投资在这类资产的金额仅仅只有数百亿日元，因此，具有进一步加大投资的空间。与此同时，德克萨斯州和加利福尼亚州的高铁项目长期融资将由日本国际合作银行通过类似的途径提供。<br/><br/>　　尽管我们并不认为在日本领取养老金的人知道，该国养老金现有对公共基础设施项目的投资回报是世界上最低的，即便收益还不是完全为负，但我们相信，这些人很快就会知道这一切，虽然全部收益率会在几年内变得明显，但是他们更大的担忧应该是日本股市和/或全球股票市场，因为GPIF将重金配置在这些市场，而这些市场存在暴跌的风险。', '', '', '', 0, 0, 1, '', 1486086551),
